--
-- Name: fn_appauth_check_day_month_year(character, date); Type: FUNCTION; Schema: public; Owner: jameaquasemia
--

CREATE FUNCTION public.fn_appauth_check_day_month_year(p_frequenct character, p_date date) RETURNS boolean
    LANGUAGE plpgsql
    AS $$
DECLARE
   w_month_end         DATE;
   w_quarter_end       DATE;
   w_half_year_end     DATE;
   w_year_end          DATE;
   w_month_start       DATE;
   w_quarter_start     DATE;
   w_half_year_start   DATE;
   w_year_start        DATE;
BEGIN
   SELECT CAST (
               date_trunc ('month', p_date)
             + INTERVAL '1 months'
             - INTERVAL '1 day'
                AS DATE)
             month_end,
          CAST (
               date_trunc ('quarter', p_date)
             + INTERVAL '3 months'
             - INTERVAL '1 day'
                AS DATE)
             quarter_end,
          CAST (
               date_trunc ('year', p_date)
             + INTERVAL '6 months'
             - INTERVAL '1 day'
                AS DATE)
             half_year_end,
          CAST (
               date_trunc ('year', p_date)
             + INTERVAL '12 months'
             - INTERVAL '1 day'
                AS DATE)
             year_end,
          CAST (date_trunc ('month', p_date) AS DATE)
             month_start,
          CAST (date_trunc ('quarter', p_date) AS DATE)
             quarter_start,
          CAST (
             CAST (EXTRACT (YEAR FROM p_date) AS INTEGER) || '-07-01' AS DATE)
             half_year_start,
          CAST (date_trunc ('year', p_date) AS DATE)
             year_start
     INTO w_month_end,
          w_quarter_end,
          w_half_year_end,
          w_year_end,
          w_month_start,
          w_quarter_start,
          w_half_year_start,
          w_year_start;

   IF p_frequenct = 'D'
   THEN
      RETURN TRUE;
   END IF;

   IF p_frequenct = 'M'
   THEN
      IF w_month_end = p_date
      THEN
         RETURN TRUE;
      END IF;
   END IF;

   IF p_frequenct = 'Q'
   THEN
      IF w_quarter_end = p_date
      THEN
         RETURN TRUE;
      END IF;
   END IF;

   IF p_frequenct = 'H'
   THEN
      IF w_half_year_end = p_date
      THEN
         RETURN TRUE;
      END IF;
   END IF;

   IF p_frequenct = 'Y'
   THEN
      IF w_year_end = p_date
      THEN
         RETURN TRUE;
      END IF;
   END IF;

   RETURN FALSE;
EXCEPTION
   WHEN OTHERS
   THEN
      RETURN FALSE;
END;
$$;


ALTER FUNCTION public.fn_appauth_check_day_month_year(p_frequenct character, p_date date) OWNER TO jameaquasemia;

--
-- Name: fn_edu_fees_generate(integer, character, character, character, character, date, character, character); Type: FUNCTION; Schema: public; Owner: jameaquasemia
--

CREATE FUNCTION public.fn_edu_fees_generate(p_branch_code integer, p_academic_year character, p_class_id character, p_class_group_id character, p_section_id character, p_process_date date, p_student_roll character, p_app_user_id character, OUT o_status character, OUT o_errm character) RETURNS record
    LANGUAGE plpgsql
    AS $$
DECLARE
   w_status                 VARCHAR;
   w_errm                   VARCHAR;
   rec_fees_list            RECORD;
   rec_students_list        RECORD;
   w_fine_effective_date    DATE;
   w_effective_date         DATE;
   w_start_date             DATE;
   w_end_date               DATE;
   w_waive_effective_date   DATE;
   w_waive_parsentag        NUMERIC (22, 2) := 0;
   w_waive_amount           NUMERIC (22, 2) := 0;
   w_no_of_month            INTEGER := 1;
   w_fees_sql               VARCHAR;
   w_students_sql           VARCHAR;
   w_waive_sql              VARCHAR;
BEGIN
   w_fees_sql :=
         'SELECT d.effective_date,
             d.fee_amount,
             d.fine_amount,
             d.class_group_id,
             d.class_id,
             d.head_code,
             d.section_id,
             d.pay_freq,
             d.fine_effective_days
        FROM edu_fees_mapping_history d,
             (  SELECT h.head_code,h.class_id,h.class_group_id,h.section_id,
                       h.effective_date,
                       max (h.day_serial) day_serial
                  FROM edu_fees_mapping_history h,
                       (  SELECT head_code,class_id,class_group_id,section_id, max (effective_date) effective_date
                            FROM edu_fees_mapping_history
                           WHERE     effective_date <= '''
      || p_process_date
      || '''';

   IF p_class_id IS NOT NULL
   THEN
      w_fees_sql := w_fees_sql || ' and class_id=''' || p_class_id || '''';
   END IF;

   IF p_class_group_id IS NOT NULL
   THEN
      w_fees_sql :=
         w_fees_sql || ' and class_group_id=''' || p_class_group_id || '''';
   END IF;

   IF p_section_id IS NOT NULL
   THEN
      w_fees_sql :=
         w_fees_sql || ' and section_id=''' || p_section_id || '''';
   END IF;

   w_fees_sql :=
         w_fees_sql
      || ' AND is_active
                                 AND NOT is_deleted
                        GROUP BY head_code,class_id,class_group_id,section_id) m
                 WHERE     h.head_code = m.head_code
                      AND  COALESCE (h.class_id,''#'') = COALESCE (m.class_id,''#'')
                      AND  COALESCE (h.class_group_id,''#'') = COALESCE (m.class_group_id,''#'')
                      AND  COALESCE (h.section_id,''#'') = COALESCE (m.section_id,''#'')
                       AND h.effective_date = m.effective_date ';

   IF p_class_id IS NOT NULL
   THEN
      w_fees_sql := w_fees_sql || ' and h.class_id=''' || p_class_id || '''';
   END IF;

   IF p_class_group_id IS NOT NULL
   THEN
      w_fees_sql :=
         w_fees_sql || ' and h.class_group_id=''' || p_class_group_id || '''';
   END IF;

   IF p_section_id IS NOT NULL
   THEN
      w_fees_sql :=
         w_fees_sql || ' and h.section_id=''' || p_section_id || '''';
   END IF;

   w_fees_sql :=
         w_fees_sql
      || '  
              GROUP BY h.head_code,h.class_id,h.class_group_id,h.section_id, h.effective_date) h
       WHERE     h.head_code = d.head_code
             AND COALESCE (h.class_id,''#'') = COALESCE (d.class_id,''#'')
             AND COALESCE (h.class_group_id,''#'') = COALESCE (d.class_group_id,''#'')
             AND COALESCE (h.section_id,''#'') = COALESCE (d.section_id,''#'')
             AND h.effective_date = d.effective_date
             AND h.day_serial = d.day_serial
             AND d.is_active
             AND NOT d.is_deleted ';

   IF p_class_id IS NOT NULL
   THEN
      w_fees_sql := w_fees_sql || ' and d.class_id=''' || p_class_id || '''';
   END IF;

   IF p_class_group_id IS NOT NULL
   THEN
      w_fees_sql :=
         w_fees_sql || ' and d.class_group_id=''' || p_class_group_id || '''';
   END IF;

   IF p_section_id IS NOT NULL
   THEN
      w_fees_sql :=
         w_fees_sql || ' and d.section_id=''' || p_section_id || '''';
   END IF;

   ---RAISE EXCEPTION USING message = w_fees_sql;

   FOR rec_fees_list IN EXECUTE w_fees_sql
   LOOP
      w_students_sql := 'SELECT student_roll,
             academic_year,
             catagory_id,
             class_id,
             class_group_id,
             section_id,
             shift_id,
             student_status,
             branch_code
        FROM edu_students_info 
        where 1=1 ';

      IF p_student_roll IS NOT NULL
      THEN
         w_students_sql :=
               w_students_sql
            || ' and student_roll='''
            || p_student_roll
            || '''';
      END IF;

      IF p_branch_code IS NOT NULL
      THEN
         w_students_sql :=
            w_students_sql || ' and branch_code= ' || p_branch_code;
      END IF;

      IF rec_fees_list.class_id IS NOT NULL
      THEN
         w_students_sql :=
               w_students_sql
            || ' and class_id='''
            || rec_fees_list.class_id
            || '''';
      END IF;

      IF rec_fees_list.class_group_id IS NOT NULL
      THEN
         w_students_sql :=
               w_students_sql
            || ' and class_group_id='''
            || rec_fees_list.class_group_id
            || '''';
      END IF;

      IF rec_fees_list.section_id IS NOT NULL
      THEN
         w_students_sql :=
               w_students_sql
            || ' and section_id='''
            || rec_fees_list.section_id
            || '''';
      END IF;

      ---RAISE EXCEPTION USING message = w_students_sql;
      --- do processing
      SELECT CAST (
                FLOOR (
                     DATE_PART ('year', AGE (end_date, start_date)) * 12
                   + DATE_PART ('month', AGE (end_date, start_date))
                   + 1)
                   AS INTEGER) no_of_month,
             start_date,
             end_date
        INTO w_no_of_month, w_start_date, w_end_date
        FROM edu_academic_year
       WHERE academic_year = p_academic_year;

      FOR rec_students_list IN EXECUTE w_students_sql
      LOOP
         IF rec_fees_list.pay_freq = 'M'
         THEN
            w_effective_date := w_start_date;
         ELSE
            w_no_of_month := 1;
            w_effective_date := rec_fees_list.effective_date;
         END IF;

         w_waive_sql :=
               'SELECT d.effective_date,
             d.waiver_parsentag,
             d.waiver_amount
        FROM edu_fees_waiver_mapping_hist d,
             (  SELECT h.head_code,h.class_id,h.class_group_id,h.section_id,
                       h.effective_date,
                       max (h.day_serial) day_serial
                  FROM edu_fees_waiver_mapping_hist h,
                       (  SELECT head_code,class_id,class_group_id,section_id, max (effective_date) effective_date
                            FROM edu_fees_waiver_mapping_hist
                           WHERE     effective_date <= '''
            || w_end_date
            || '''';

         IF rec_fees_list.class_id IS NOT NULL
         THEN
            w_waive_sql :=
                  w_waive_sql
               || ' and class_id='''
               || rec_fees_list.class_id
               || '''';
         END IF;

         IF rec_fees_list.head_code IS NOT NULL
         THEN
            w_waive_sql :=
                  w_waive_sql
               || ' and head_code='''
               || rec_fees_list.head_code
               || '''';
         END IF;

         IF rec_fees_list.class_group_id IS NOT NULL
         THEN
            w_waive_sql :=
                  w_waive_sql
               || ' and class_group_id='''
               || rec_fees_list.class_group_id
               || '''';
         END IF;

         IF rec_fees_list.section_id IS NOT NULL
         THEN
            w_waive_sql :=
                  w_waive_sql
               || ' and section_id='''
               || rec_fees_list.section_id
               || '''';
         END IF;

         w_waive_sql :=
               w_waive_sql
            || ' AND is_active
                                 AND NOT is_deleted
                        GROUP BY head_code,class_id,class_group_id,section_id) m
                 WHERE     h.head_code = m.head_code
                      AND  COALESCE (h.class_id,''#'') = COALESCE (m.class_id,''#'')
                      AND  COALESCE (h.class_group_id,''#'') = COALESCE (m.class_group_id,''#'')
                      AND  COALESCE (h.section_id,''#'') = COALESCE (m.section_id,''#'')
                       AND h.effective_date = m.effective_date ';

         IF rec_fees_list.class_id IS NOT NULL
         THEN
            w_waive_sql :=
                  w_waive_sql
               || ' and h.class_id='''
               || rec_fees_list.class_id
               || '''';
         END IF;

         IF rec_fees_list.head_code IS NOT NULL
         THEN
            w_waive_sql :=
                  w_waive_sql
               || ' and h.head_code='''
               || rec_fees_list.head_code
               || '''';
         END IF;

         IF rec_fees_list.class_group_id IS NOT NULL
         THEN
            w_waive_sql :=
                  w_waive_sql
               || ' and h.class_group_id='''
               || rec_fees_list.class_group_id
               || '''';
         END IF;

         IF rec_fees_list.section_id IS NOT NULL
         THEN
            w_waive_sql :=
                  w_waive_sql
               || ' and h.section_id='''
               || rec_fees_list.section_id
               || '''';
         END IF;

         w_waive_sql :=
               w_waive_sql
            || '  
              GROUP BY h.head_code,h.class_id,h.class_group_id,h.section_id, h.effective_date) h
       WHERE     h.head_code = d.head_code
             AND COALESCE (h.class_id,''#'') = COALESCE (d.class_id,''#'')
             AND COALESCE (h.class_group_id,''#'') = COALESCE (d.class_group_id,''#'')
             AND COALESCE (h.section_id,''#'') = COALESCE (d.section_id,''#'')
             AND h.effective_date = d.effective_date
             AND h.day_serial = d.day_serial
             AND d.is_active
             AND NOT d.is_deleted ';

         IF rec_fees_list.class_id IS NOT NULL
         THEN
            w_waive_sql :=
                  w_waive_sql
               || ' and d.class_id='''
               || rec_fees_list.class_id
               || '''';
         END IF;

         IF rec_fees_list.head_code IS NOT NULL
         THEN
            w_waive_sql :=
                  w_waive_sql
               || ' and d.head_code='''
               || rec_fees_list.head_code
               || '''';
         END IF;

         IF rec_fees_list.class_group_id IS NOT NULL
         THEN
            w_waive_sql :=
                  w_waive_sql
               || ' and d.class_group_id='''
               || rec_fees_list.class_group_id
               || '''';
         END IF;

         IF rec_fees_list.section_id IS NOT NULL
         THEN
            w_waive_sql :=
                  w_waive_sql
               || ' and d.section_id='''
               || rec_fees_list.section_id
               || '''';
         END IF;

         EXECUTE w_waive_sql
            INTO w_waive_effective_date, w_waive_parsentag, w_waive_amount;

         FOR noi IN 1 .. w_no_of_month
         LOOP
            UPDATE edu_fees_due_student
               SET cancel_by = p_app_user_id, cancel_on = current_timestamp
             WHERE     student_roll = rec_students_list.student_roll
                   AND academic_year = p_academic_year
                   AND due_date = w_effective_date
                   AND head_code = rec_fees_list.head_code;

            IF rec_fees_list.fine_effective_days > 0
            THEN
               w_fine_effective_date :=
                  w_effective_date + rec_fees_list.fine_effective_days;
            ELSE
               w_fine_effective_date := NULL;
            END IF;

            w_waive_amount :=
               GREATEST (
                  ROUND (
                       rec_fees_list.fee_amount
                     * (COALESCE (w_waive_parsentag, 0.00) / 100)),
                  COALESCE (w_waive_amount, 0.00));

            INSERT INTO edu_fees_due_student (student_roll,
                                              academic_year,
                                              head_code,
                                              due_date,
                                              process_date,
                                              fine_due_date,
                                              fee_amount,
                                              waive_percentage,
                                              waive_amount,
                                              fine_waive,
                                              fine_amount,
                                              app_user_id,
                                              app_data_time)
                 VALUES (rec_students_list.student_roll,
                         p_academic_year,
                         rec_fees_list.head_code,
                         w_effective_date,
                         p_process_date,
                         w_fine_effective_date,
                         rec_fees_list.fee_amount,
                         COALESCE (w_waive_parsentag, 0.00),
                         COALESCE (w_waive_amount, 0.00),
                         0.00,
                         rec_fees_list.fine_amount,
                         p_app_user_id,
                         current_timestamp);

            w_effective_date :=
               fn_get_next_installment_date (rec_fees_list.pay_freq,
                                             w_start_date,
                                             w_effective_date);
         END LOOP;
      END LOOP;
   END LOOP;

   o_status := 'S';
   o_errm := '';
EXCEPTION
   WHEN OTHERS
   THEN
      o_status := 'E';
      o_errm := SQLERRM;
END;
$$;


ALTER FUNCTION public.fn_edu_fees_generate(p_branch_code integer, p_academic_year character, p_class_id character, p_class_group_id character, p_section_id character, p_process_date date, p_student_roll character, p_app_user_id character, OUT o_status character, OUT o_errm character) OWNER TO jameaquasemia;

--
-- Name: fn_edu_fees_students(character, date); Type: FUNCTION; Schema: public; Owner: jameaquasemia
--

CREATE FUNCTION public.fn_edu_fees_students(p_student_roll character, p_collection_date date) RETURNS SETOF public.edu_fees_students
    LANGUAGE plpgsql
    AS $$
DECLARE
   w_status                 VARCHAR;
   w_errm                   VARCHAR;
   w_current_business_day   DATE;
   result_record            edu_fees_students;
   rec_student_list         RECORD;
   rec_fees_list            RECORD;
   w_fine_due               NUMERIC (22, 2) := 0;
   w_payment_balance        NUMERIC (22, 2) := 0;
   w_total_paid             NUMERIC (22, 2) := 0;
   w_due_balance            NUMERIC (22, 2) := 0;
   w_payment_date           DATE;
BEGIN
   FOR rec_fees_list
      IN (SELECT *
              FROM (  SELECT d.due_serial
                                serial_number,
                             d.head_code,
                             LAG (d.head_code, 1)
                             OVER (PARTITION BY d.head_code
                                   ORDER BY d.head_code, d.due_date)
                                prev_head_code,
                             d.due_date,
                             d.fine_due_date,
                             d.fee_amount
                                fees_due,
                             d.fine_amount,
                             d.fine_waive,
                             d.waive_amount
                                fees_waive,
                             p.receipt_serial,
                             p.head_code
                                payment_head_code,
                             p.receive_date
                                payment_date,
                             p.total_paid,
                             sum (d.fee_amount)
                             OVER (PARTITION BY d.head_code
                                   ORDER BY d.head_code, d.due_date)
                                due_balance,
                             sum (d.waive_amount)
                             OVER (PARTITION BY d.head_code
                                   ORDER BY d.head_code, d.due_date)
                                waive_balance,
                             sum (d.fine_waive)
                             OVER (PARTITION BY d.head_code
                                   ORDER BY d.head_code, d.due_date)
                                fine_waive_balance,
                             sum (p.total_paid)
                             OVER (PARTITION BY COALESCE (p.head_code, d.head_code)
                                   ORDER BY p.head_code)
                                payment_balance
                        FROM (  SELECT row_number ()
                                       OVER (PARTITION BY head_code
                                             ORDER BY head_code, due_date)
                                          due_serial,
                                       head_code,
                                       due_date,
                                       fine_due_date,
                                       sum (fee_amount)
                                          fee_amount,
                                       sum (fine_amount)
                                          fine_amount,
                                       sum (waive_amount)
                                          waive_amount,
                                       sum (fine_waive)
                                          fine_waive
                                  FROM edu_fees_due_student
                                 WHERE     student_roll = p_student_roll
                                       AND cancel_by IS NULL
                              GROUP BY head_code, due_date, fine_due_date
                              ORDER BY due_date) d
                             FULL OUTER JOIN
                             (  SELECT row_number ()
                                       OVER (PARTITION BY head_code
                                             ORDER BY head_code, receive_date)
                                          receipt_serial,
                                       head_code,
                                       receive_date,
                                       sum (total_paid)
                                          total_paid
                                  FROM edu_fees_receive_student
                                 WHERE     student_roll = p_student_roll
                                       AND cancel_by IS NULL
                              GROUP BY head_code, receive_date
                              ORDER BY receive_date) p
                                ON (    d.head_code = p.head_code
                                    AND d.due_serial = p.receipt_serial)
                    ORDER BY d.head_code, d.due_date) t
          ORDER BY COALESCE (head_code, payment_head_code),
                   COALESCE (serial_number, receipt_serial))
   LOOP
      IF rec_fees_list.payment_date < rec_fees_list.fine_due_date
      THEN
         w_payment_balance := COALESCE (rec_fees_list.payment_balance, 0.00);
      ELSE
         w_payment_balance := 0.00;
      END IF;

      IF rec_fees_list.payment_date IS NOT NULL
      THEN
         w_total_paid := COALESCE (rec_fees_list.payment_balance, 0.00);
         w_payment_date := rec_fees_list.payment_date;
      END IF;

      IF w_payment_date < rec_fees_list.due_date
      THEN
         w_payment_date := NULL;
         w_total_paid := 0.00;
      END IF;

      IF     (rec_fees_list.due_balance - w_payment_balance) > 0
         AND rec_fees_list.fine_due_date < p_collection_date
      THEN
         w_fine_due := rec_fees_list.fine_amount;
      ELSE
         w_fine_due := 0.00;
      END IF;


      result_record.serial_number := rec_fees_list.serial_number;
      result_record.head_code := rec_fees_list.head_code;
      result_record.due_date := rec_fees_list.due_date;
      result_record.fine_due := w_fine_due;
      result_record.fees_due := rec_fees_list.fees_due;
      result_record.fine_waive := COALESCE (rec_fees_list.fine_waive, 0.00);
      result_record.fees_waive := COALESCE (rec_fees_list.fees_waive, 0.00);
      result_record.total_waive :=
         result_record.fees_waive + result_record.fine_waive;
      result_record.total_due :=
         (  result_record.fine_due
          + result_record.fees_due
          - result_record.total_waive);

      IF rec_fees_list.serial_number <> 1
      THEN
         w_due_balance := w_due_balance + result_record.total_due;
      ELSE
         w_due_balance := result_record.total_due;
      END IF;

      result_record.payment_date := w_payment_date;
      result_record.total_paid := w_total_paid;
      result_record.due_balance := w_due_balance;
      result_record.payment_balance :=
         COALESCE (rec_fees_list.payment_balance, 0.00);
      result_record.actual_due :=
         greatest (
            least (
                 result_record.due_balance
               + w_fine_due
               - result_record.payment_balance
               - result_record.total_waive,
               (  rec_fees_list.fees_due
                + w_fine_due
                - result_record.total_waive)),
            0.00);

      RETURN NEXT
         result_record;
   END LOOP;

   RETURN;
EXCEPTION
   WHEN OTHERS
   THEN
      NULL;
END;
$$;


ALTER FUNCTION public.fn_edu_fees_students(p_student_roll character, p_collection_date date) OWNER TO jameaquasemia;

--
-- Name: fn_edu_fees_submit(character, date, character); Type: FUNCTION; Schema: public; Owner: jameaquasemia
--

CREATE FUNCTION public.fn_edu_fees_submit(p_student_roll character, p_collection_date date, p_app_user_id character, OUT o_status character, OUT o_errm character, OUT o_transaction_id character) RETURNS record
    LANGUAGE plpgsql
    AS $$
DECLARE
   w_tran_gl_code           VARCHAR := '0';
   w_contra_gl_code         VARCHAR := '0';
   w_cash_gl_code           VARCHAR := '0';
   w_account_number         VARCHAR := '0';
   w_debit_credit           VARCHAR;
   w_tran_type              VARCHAR;
   w_serial_no              INTEGER := 0;
   w_batch_number           INTEGER := 0;
   w_tran_amount            NUMERIC (22, 2) := 0;
   w_total_receive_amount   NUMERIC (22, 2) := 0;
   w_tran_naration          VARCHAR;
   w_branch_code            INTEGER := 0;
   rec_fees_list            RECORD;
   w_transaction_id         VARCHAR;
   w_status                 VARCHAR;
   w_errm                   VARCHAR;
BEGIN
   w_transaction_id :=
      fn_get_inventory_number (30001,
                               100,
                               'FE',
                               'Student Fee Receive',
                               8);

   BEGIN
      SELECT cash_gl_code
        INTO STRICT w_cash_gl_code
        FROM finance_application_settings;
   EXCEPTION
      WHEN NO_DATA_FOUND
      THEN
         RAISE EXCEPTION
         USING message = 'Cash in Hand Ledger is Not Confired!';
   END;

   BEGIN
      SELECT branch_code
        INTO w_branch_code
        FROM appauth_user_settings
       WHERE app_user_id = p_app_user_id;
   END;


   BEGIN
      SELECT branch_code
        INTO w_branch_code
        FROM edu_students_info
       WHERE student_roll = p_student_roll;
   END;


   ---RAISE EXCEPTION USING message = 'A';

   FOR rec_fees_list
      IN (SELECT *
           FROM edu_fees_receive_temp
          WHERE     app_user_id = p_app_user_id
                AND student_roll = p_student_roll
                AND total_paid > 0)
   LOOP
      IF rec_fees_list.total_paid > 0
      THEN
         w_total_receive_amount :=
            w_total_receive_amount + rec_fees_list.total_paid;

         w_tran_gl_code := rec_fees_list.ledger_code;
         w_contra_gl_code := w_cash_gl_code;
         w_account_number := '0';
         w_tran_amount := rec_fees_list.total_paid;
         w_tran_naration :=
            rec_fees_list.head_name || ' - ' || p_student_roll;
         w_serial_no := w_serial_no + 1;
         w_debit_credit := 'C';
         w_tran_type := 'FEES';

         INSERT INTO finance_transaction_table (branch_code,
                                                transaction_date,
                                                batch_serial,
                                                account_number,
                                                tran_gl_code,
                                                contra_gl_code,
                                                tran_debit_credit,
                                                tran_type,
                                                tran_amount,
                                                available_balance,
                                                tran_person_phone,
                                                tran_person_name,
                                                tran_document_prefix,
                                                tran_document_number,
                                                tran_sign_verified,
                                                system_posted_tran,
                                                transaction_narration,
                                                app_user_id,
                                                app_data_time)
              VALUES (w_branch_code,
                      p_collection_date,
                      w_serial_no,
                      '0',
                      w_tran_gl_code,
                      w_contra_gl_code,
                      w_debit_credit,
                      w_tran_type,
                      w_tran_amount,
                      0,
                      '',
                      NULL,
                      NULL,
                      NULL,
                      FALSE,
                      TRUE,
                      w_tran_naration,
                      p_app_user_id,
                      current_timestamp);

         w_tran_gl_code := w_cash_gl_code;
         w_contra_gl_code := rec_fees_list.ledger_code;
         w_account_number := '0';
         w_tran_amount := rec_fees_list.total_paid;
         w_tran_naration :=
            rec_fees_list.head_name || ' - ' || p_student_roll;
         w_serial_no := w_serial_no + 1;
         w_debit_credit := 'D';
         w_tran_type := 'FEES';

         INSERT INTO finance_transaction_table (branch_code,
                                                transaction_date,
                                                batch_serial,
                                                account_number,
                                                tran_gl_code,
                                                contra_gl_code,
                                                tran_debit_credit,
                                                tran_type,
                                                tran_amount,
                                                available_balance,
                                                tran_person_phone,
                                                tran_person_name,
                                                tran_document_prefix,
                                                tran_document_number,
                                                tran_sign_verified,
                                                system_posted_tran,
                                                transaction_narration,
                                                app_user_id,
                                                app_data_time)
              VALUES (w_branch_code,
                      p_collection_date,
                      w_serial_no,
                      '0',
                      w_tran_gl_code,
                      w_contra_gl_code,
                      w_debit_credit,
                      w_tran_type,
                      w_tran_amount,
                      0,
                      '',
                      NULL,
                      NULL,
                      NULL,
                      FALSE,
                      TRUE,
                      w_tran_naration,
                      p_app_user_id,
                      current_timestamp);

         INSERT INTO edu_fees_receive_student (branch_code,
                                               transaction_id,
                                               student_roll,
                                               head_code,
                                               ledger_code,
                                               receive_date,
                                               receive_year,
                                               receive_month,
                                               due_date,
                                               fees_due,
                                               fees_waive,
                                               fine_due,
                                               fine_waive,
                                               total_due,
                                               total_waive,
                                               fees_paid,
                                               fine_paid,
                                               total_paid,
                                               fees_overdue,
                                               fine_overdue,
                                               total_overdue,
                                               auth_by,
                                               auth_on,
                                               cancel_by,
                                               cancel_on,
                                               app_user_id,
                                               app_data_time)
                 VALUES (
                           w_branch_code,
                           w_transaction_id,
                           p_student_roll,
                           rec_fees_list.head_code,
                           rec_fees_list.ledger_code,
                           p_collection_date,
                           cast (
                              to_char (p_collection_date, 'YYYY') AS INTEGER),
                           cast (
                              to_char (p_collection_date, 'MM') AS INTEGER),
                           rec_fees_list.due_date,
                           rec_fees_list.fees_due,
                           rec_fees_list.fees_waive,
                           rec_fees_list.fine_due,
                           rec_fees_list.fine_waive,
                           rec_fees_list.total_due,
                           rec_fees_list.total_waive,
                             rec_fees_list.total_paid
                           - rec_fees_list.fine_waive
                           - rec_fees_list.fine_due,              ---fees_paid
                           rec_fees_list.fine_due - rec_fees_list.fine_waive, ---fine_paid
                           rec_fees_list.total_paid,
                             rec_fees_list.fees_due
                           - rec_fees_list.total_paid
                           + rec_fees_list.fine_due
                           - rec_fees_list.fine_waive,         ---fees_overdue
                           rec_fees_list.fine_overdue,
                           rec_fees_list.total_overdue,
                           p_app_user_id,
                           current_timestamp,
                           NULL,
                           NULL,
                           p_app_user_id,
                           current_timestamp);
      END IF;
   END LOOP;

   BEGIN
      SELECT *
        INTO w_status, w_errm, w_batch_number
        FROM fn_finance_post_tran (w_branch_code,
                                   p_app_user_id,
                                   'FEES',
                                   p_collection_date,
                                   'Fee Receive ' || p_student_roll,
                                   'FEES');

      IF w_status = 'E'
      THEN
         RAISE EXCEPTION USING message = w_errm;
      ELSE
         INSERT INTO edu_fees_receive_summary (branch_code,
                                               transaction_id,
                                               student_roll,
                                               receive_date,
                                               receive_amount,
                                               tran_batch_number,
                                               auth_by,
                                               auth_on,
                                               app_user_id,
                                               app_data_time)
              VALUES (w_branch_code,
                      w_transaction_id,
                      p_student_roll,
                      p_collection_date,
                      w_total_receive_amount,
                      w_batch_number,
                      p_app_user_id,
                      current_timestamp,
                      p_app_user_id,
                      current_timestamp);

         o_transaction_id := w_transaction_id;

         DELETE FROM
            edu_fees_receive_temp
               WHERE     app_user_id = p_app_user_id
                     AND student_roll = p_student_roll;
      END IF;
   END;

   o_status := 'S';
   o_errm := '';
EXCEPTION
   WHEN OTHERS
   THEN
      o_status := 'E';
      o_errm := SQLERRM;
END;
$$;


ALTER FUNCTION public.fn_edu_fees_submit(p_student_roll character, p_collection_date date, p_app_user_id character, OUT o_status character, OUT o_errm character, OUT o_transaction_id character) OWNER TO jameaquasemia;

--
-- Name: fn_edu_fees_tempdata(character, date, character); Type: FUNCTION; Schema: public; Owner: jameaquasemia
--

CREATE FUNCTION public.fn_edu_fees_tempdata(p_student_roll character, p_collection_date date, p_app_user_id character, OUT o_status character, OUT o_errm character) RETURNS record
    LANGUAGE plpgsql
    AS $$
DECLARE
   w_status            VARCHAR;
   w_errm              VARCHAR;
   rec_fees_due_list   RECORD;
BEGIN
   DELETE FROM edu_fees_receive_temp
         WHERE app_user_id = p_app_user_id;

   INSERT INTO edu_fees_receive_temp (student_roll,
                                      head_code,
                                      head_name,
                                      ledger_code,
                                      due_date,
                                      total_due,
                                      total_paid,
                                      total_waive,
                                      fees_due,
                                      fine_due,
                                      fees_waive,
                                      fine_waive,
                                      total_overdue,
                                      app_user_id,
                                      app_data_time)
        SELECT p_student_roll student_roll,
               h.head_code,
               h.head_name,
               h.head_ledger,
               d.due_date,
               d.actual_due,
               NULL,
               d.total_waive,
               d.fees_due,
               d.fine_due,
               d.fees_waive,
               d.fine_waive,
               0.00,
               p_app_user_id,
               current_timestamp
          FROM fn_edu_fees_students (p_student_roll, p_collection_date) d,
               edu_fees_head_settings h
         WHERE     d.head_code = h.head_code
               AND d.actual_due > 0
               AND d.due_date <= p_collection_date
      ORDER BY h.head_code, d.serial_number;

   o_status := 'S';
   o_errm := '';
EXCEPTION
   WHEN OTHERS
   THEN
      o_status := 'E';
      o_errm := SQLERRM;
END;
$$;


