-- Name: fn_edu_fees_waive_tempdata(character, date, character); Type: FUNCTION; Schema: public; Owner: jameaquasemia
--

CREATE FUNCTION public.fn_edu_fees_waive_tempdata(p_student_roll character, p_waive_date date, p_app_user_id character, OUT o_status character, OUT o_errm character) RETURNS record
    LANGUAGE plpgsql
    AS $$
DECLARE
   w_status            VARCHAR;
   w_errm              VARCHAR;
   rec_fees_due_list   RECORD;
BEGIN
   DELETE FROM edu_fees_receive_temp
         WHERE app_user_id = p_app_user_id;

   INSERT INTO edu_fees_receive_temp (student_roll,
                                      head_code,
                                      head_name,
                                      ledger_code,
                                      due_date,
                                      total_due,
                                      total_paid,
                                      total_overdue,
                                      total_waiver,
                                      fine_payable,
                                      fees_payable,
                                      app_user_id,
                                      app_data_time)
        SELECT p_student_roll student_roll,
               h.head_code,
               h.head_name,
               h.head_ledger,
               d.due_date,
               d.actual_due,
               NULL,
               0.00,
               d.total_waiver,
               d.fine_due,
               d.fees_due,
               p_app_user_id,
               current_timestamp
          FROM fn_edu_fees_students (p_student_roll, current_date) d,
               edu_fees_head_settings h
         WHERE     d.head_code = h.head_code
               AND (d.due_balance - d.payment_balance) > 0
               AND d.due_date <= p_collection_date
      ORDER BY h.head_code, d.serial_number;

   o_status := 'S';
   o_errm := '';
EXCEPTION
   WHEN OTHERS
   THEN
      o_status := 'E';
      o_errm := SQLERRM;
END;
$$;


