                            AND transaction_date BETWEEN w_month_start_date
                                                     AND w_month_end_date
                   GROUP BY gl_code, branch_code),
               gl_balance
               AS
                  (  SELECT h.gl_code,
                            h.branch_code,
                            sum (gl_balance) gl_balance,
                            sum (cum_credit_sum) cum_credit_sum,
                            sum (cum_debit_sum) cum_debit_sum
                       FROM finance_led_rec_pay_bal_hist h,
                            (  SELECT branch_code,
                                      gl_code,
                                      max (transaction_date) last_transaction_date
                                 FROM finance_led_rec_pay_bal_hist g
                                WHERE     g.gl_code = p_gl_code
                                      AND g.branch_code = p_branch_code
                                      AND g.transaction_date <= w_month_end_date
                             GROUP BY branch_code, gl_code) b
                      WHERE     h.gl_code = p_gl_code
                            AND h.branch_code = p_branch_code
                            AND h.transaction_date = b.last_transaction_date
                            AND h.branch_code = b.branch_code
                   GROUP BY h.gl_code, h.branch_code)
            SELECT s.branch_code,
                   s.gl_code,
                   w_month_end_date,
                   w_calculate_month,
                   w_calculate_year,
                   w_transaction_year_month,
                   total_debit_sum,
                   total_credit_sum,
                   cum_credit_sum,
                   cum_debit_sum,
                   gl_balance,
                   'SYSTEM',
                   current_timestamp
              FROM gl_sum_bal s, gl_balance b
             WHERE s.gl_code = b.gl_code AND s.branch_code = b.branch_code;

         w_calculate_date :=
            CAST (w_calculate_date + INTERVAL '1 month' AS DATE);
      END LOOP;

      UPDATE finance_ledger_balance
         SET last_monbal_recpay_update = rec_gl_list.last_transaction_date,
             is_monbal_recpay_updated = TRUE
       WHERE branch_code = rec_gl_list.branch_code AND gl_code = p_gl_code;
   END LOOP;

   o_status := 'S';
   o_errm := '';
EXCEPTION
   WHEN OTHERS
   THEN
      IF w_status = 'E'
      THEN
         o_status := w_status;
         o_errm := w_errm;
      ELSE
         o_status := 'E';
         o_errm := SQLERRM;
      END IF;
END;
$$;


ALTER FUNCTION public.fn_finance_glmonbal_recpay_hist(p_gl_code character, p_branch_code integer, p_ason_date date, OUT o_status character, OUT o_errm character) OWNER TO jameaquasemia;

--
-- Name: fn_finance_ibrtran_post(character, character); Type: FUNCTION; Schema: public; Owner: jameaquasemia
--

CREATE FUNCTION public.fn_finance_ibrtran_post(p_transaction_id character, p_app_user_id character, OUT o_status character, OUT o_errm character) RETURNS record
    LANGUAGE plpgsql
    AS $$
DECLARE
   w_status                 VARCHAR;
   w_errm                   VARCHAR;
   w_current_business_day   DATE;
   rec_tran_list            RECORD;
   w_tran_type              VARCHAR := '0';
   w_tran_ac_number         VARCHAR := '0';
   w_tran_gl_code           VARCHAR := '0';
   w_contra_gl_code         VARCHAR := '0';
   w_cash_transaction       BOOLEAN;
   w_total_leg              INTEGER;
   w_tran_amount            NUMERIC (22, 2) := 0;
   w_principal_amount       NUMERIC (22, 2) := 0;
   w_charge_amount          NUMERIC (22, 2) := 0;
   w_interest_amount        NUMERIC (22, 2) := 0;
   w_serial_no              INTEGER := 0;
   w_day_serial_no          INTEGER := 0;
   w_debit_credit           VARCHAR;
   w_tran_reference         VARCHAR;
   w_batch_number           INTEGER;
   w_ibr_gl_code            VARCHAR := '0';
   w_branch_code            INTEGER := 0;
   w_acbrn_code             INTEGER := 0;
   w_tran_narration         VARCHAR := 0;
   w_transaction_date       DATE;
BEGIN
   SELECT inter_branch_ledger
     INTO w_ibr_gl_code
     FROM finance_application_settings;

   IF w_ibr_gl_code IS NULL
   THEN
      RAISE EXCEPTION USING MESSAGE = 'Invalid IBR GL Configuration';
   END IF;

   FOR rec_tran_list IN (SELECT org_branch_code,
                                res_branch_code,
                                transaction_date,
                                org_gl_code,
                                res_gl_code,
                                tran_amount,
                                cancel_amount,
                                transaction_narration,
                                app_user_id,
                                transaction_id,
                                tran_status,
                                cancel_by,
                                auth_by
                           FROM finance_transaction_ibr
                          WHERE transaction_id = p_transaction_id)
   LOOP
      w_tran_amount := rec_tran_list.tran_amount;
      w_branch_code := rec_tran_list.res_branch_code;
      w_transaction_date := rec_tran_list.transaction_date;

      IF w_tran_amount <= 0
      THEN
         RAISE EXCEPTION
         USING MESSAGE = 'Transaction amount can not be Zero or Negative!';
      END IF;

      IF rec_tran_list.org_gl_code IS NULL
      THEN
         RAISE EXCEPTION USING MESSAGE = 'Orginating Ledger is Null!';
      END IF;

      IF rec_tran_list.res_gl_code IS NULL
      THEN
         RAISE EXCEPTION USING MESSAGE = 'Responding Ledger is Null!';
      END IF;

      IF rec_tran_list.cancel_by IS NOT NULL
      THEN
         RAISE EXCEPTION USING MESSAGE = 'Transaction already Canceled!';
      END IF;

      IF rec_tran_list.auth_by IS NOT NULL
      THEN
         RAISE EXCEPTION USING MESSAGE = 'Transaction already Authorized!';
      END IF;

      --- Credit Orginating Branch Ledger
      w_serial_no := w_serial_no + 1;
      w_tran_ac_number := '0';
      w_tran_gl_code := rec_tran_list.org_gl_code;
      w_contra_gl_code := w_ibr_gl_code;
      w_tran_type := 'IBR_POST';
      w_tran_amount := rec_tran_list.tran_amount;
      w_debit_credit := 'C';
      w_tran_narration :=
         'IBR Transaction ' || rec_tran_list.transaction_narration;
      w_tran_reference := rec_tran_list.transaction_id;
      w_acbrn_code := rec_tran_list.org_branch_code;

      INSERT INTO finance_transaction_table (branch_code,
                                             acbrn_code,
                                             transaction_date,
                                             batch_serial,
                                             account_number,
                                             tran_gl_code,
                                             contra_gl_code,
                                             tran_debit_credit,
                                             tran_type,
                                             tran_amount,
                                             available_balance,
                                             tran_person_phone,
                                             tran_person_name,
                                             tran_document_prefix,
                                             tran_document_number,
                                             tran_sign_verified,
                                             system_posted_tran,
                                             transaction_narration,
                                             app_user_id,
                                             app_data_time)
           VALUES (w_branch_code,
                   w_acbrn_code,
                   w_transaction_date,
                   w_serial_no,
                   w_tran_ac_number,
                   w_tran_gl_code,
                   w_contra_gl_code,
                   w_debit_credit,
                   w_tran_type,
                   w_tran_amount,
                   0,
                   '',
                   '',
                   NULL,
                   w_tran_reference,
                   FALSE,
                   TRUE,
                   w_tran_narration,
                   p_app_user_id,
                   current_timestamp);


      --- Debit Orginating Branch IBR Ledger
      w_serial_no := w_serial_no + 1;
      w_tran_ac_number := '0';
      w_tran_gl_code := w_ibr_gl_code;
      w_contra_gl_code := rec_tran_list.org_gl_code;
      w_tran_type := 'IBR_POST';
      w_tran_amount := rec_tran_list.tran_amount;
      w_debit_credit := 'D';
      w_tran_narration :=
         'IBR Transaction ' || rec_tran_list.transaction_narration;
      w_tran_reference := rec_tran_list.transaction_id;
      w_acbrn_code := rec_tran_list.org_branch_code;

      INSERT INTO finance_transaction_table (branch_code,
                                             acbrn_code,
                                             transaction_date,
                                             batch_serial,
                                             account_number,
                                             tran_gl_code,
                                             contra_gl_code,
                                             tran_debit_credit,
                                             tran_type,
                                             tran_amount,
                                             available_balance,
                                             tran_person_phone,
                                             tran_person_name,
                                             tran_document_prefix,
                                             tran_document_number,
                                             tran_sign_verified,
                                             system_posted_tran,
                                             transaction_narration,
                                             app_user_id,
                                             app_data_time)
           VALUES (w_branch_code,
                   w_acbrn_code,
                   w_transaction_date,
                   w_serial_no,
                   w_tran_ac_number,
                   w_tran_gl_code,
                   w_contra_gl_code,
                   w_debit_credit,
                   w_tran_type,
                   w_tran_amount,
                   0,
                   '',
                   '',
                   NULL,
                   w_tran_reference,
                   FALSE,
                   TRUE,
                   w_tran_narration,
                   p_app_user_id,
                   current_timestamp);


      --- Credit Respinding Branch IBR Ledger
      w_serial_no := w_serial_no + 1;
      w_tran_ac_number := '0';
      w_tran_gl_code := w_ibr_gl_code;
      w_contra_gl_code := rec_tran_list.res_gl_code;
      w_tran_type := 'IBR_POST';
      w_tran_amount := rec_tran_list.tran_amount;
      w_debit_credit := 'C';
      w_tran_narration :=
         'IBR Transaction ' || rec_tran_list.transaction_narration;
      w_tran_reference := rec_tran_list.transaction_id;
      w_acbrn_code := rec_tran_list.res_branch_code;

      INSERT INTO finance_transaction_table (branch_code,
                                             acbrn_code,
                                             transaction_date,
                                             batch_serial,
                                             account_number,
                                             tran_gl_code,
                                             contra_gl_code,
                                             tran_debit_credit,
                                             tran_type,
                                             tran_amount,
                                             available_balance,
                                             tran_person_phone,
                                             tran_person_name,
                                             tran_document_prefix,
                                             tran_document_number,
                                             tran_sign_verified,
                                             system_posted_tran,
                                             transaction_narration,
                                             app_user_id,
                                             app_data_time)
           VALUES (w_branch_code,
                   w_acbrn_code,
                   w_transaction_date,
                   w_serial_no,
                   w_tran_ac_number,
                   w_tran_gl_code,
                   w_contra_gl_code,
                   w_debit_credit,
                   w_tran_type,
                   w_tran_amount,
                   0,
                   '',
                   '',
                   NULL,
                   w_tran_reference,
                   FALSE,
                   TRUE,
                   w_tran_narration,
                   p_app_user_id,
                   current_timestamp);

      --- Debit Respinding Branch Ledger
      w_serial_no := w_serial_no + 1;
      w_tran_ac_number := '0';
      w_tran_gl_code := rec_tran_list.res_gl_code;
      w_contra_gl_code := w_ibr_gl_code;
      w_tran_type := 'IBR_POST';
      w_tran_amount := rec_tran_list.tran_amount;
      w_debit_credit := 'D';
      w_tran_narration :=
         'IBR Transaction ' || rec_tran_list.transaction_narration;
      w_tran_reference := rec_tran_list.transaction_id;
      w_acbrn_code := rec_tran_list.res_branch_code;

      INSERT INTO finance_transaction_table (branch_code,
                                             acbrn_code,
                                             transaction_date,
                                             batch_serial,
                                             account_number,
                                             tran_gl_code,
                                             contra_gl_code,
                                             tran_debit_credit,
                                             tran_type,
                                             tran_amount,
                                             available_balance,
                                             tran_person_phone,
                                             tran_person_name,
                                             tran_document_prefix,
                                             tran_document_number,
                                             tran_sign_verified,
                                             system_posted_tran,
                                             transaction_narration,
                                             app_user_id,
                                             app_data_time)
           VALUES (w_branch_code,
                   w_acbrn_code,
                   w_transaction_date,
                   w_serial_no,
                   w_tran_ac_number,
                   w_tran_gl_code,
                   w_contra_gl_code,
                   w_debit_credit,
                   w_tran_type,
                   w_tran_amount,
                   0,
                   '',
                   '',
                   NULL,
                   w_tran_reference,
                   FALSE,
                   TRUE,
                   w_tran_narration,
                   p_app_user_id,
                   current_timestamp);
   END LOOP;

   BEGIN
      SELECT *
        INTO w_status, w_errm, w_batch_number
        FROM fn_finance_post_tran (w_branch_code,
                                   p_app_user_id,
                                   'IBR_POST',
                                   w_transaction_date,
                                   'Inter Branch Fund Transfer',
                                   'IBR_POST');

      IF w_status = 'E'
      THEN
         RAISE EXCEPTION USING MESSAGE = w_errm;
      ELSE
         BEGIN
            UPDATE finance_transaction_ibr
               SET tran_status = 'A',
                   batch_number = w_batch_number,
                   auth_by = p_app_user_id,
                   auth_on = current_timestamp
             WHERE transaction_id = p_transaction_id;
         END;
      END IF;
   END;

   o_status := 'S';
   o_errm := w_batch_number;
EXCEPTION
   WHEN OTHERS
   THEN
      IF w_status = 'E'
      THEN
         o_status := w_status;
         o_errm := w_errm;
      ELSE
         o_errm := SQLERRM;
         o_status := 'E';
      END IF;
END;
$$;


ALTER FUNCTION public.fn_finance_ibrtran_post(p_transaction_id character, p_app_user_id character, OUT o_status character, OUT o_errm character) OWNER TO jameaquasemia;

--
-- Name: fn_finance_post_cash_tran(integer, character, character, character, date, character, character, character); Type: FUNCTION; Schema: public; Owner: jameaquasemia
--

CREATE FUNCTION public.fn_finance_post_cash_tran(p_branch_code integer, p_app_user_id character, p_transaction_type character, p_transaction_ledger character, p_tran_date date, p_tran_narration character, p_receive_payment character, p_tran_source character, OUT o_status character, OUT o_errm character, OUT o_batch_number character) RETURNS record
    LANGUAGE plpgsql
    AS $$
DECLARE
   w_error_message         VARCHAR;
   w_batch_number          INTEGER;
   w_check                 BOOLEAN;
   w_account_number        VARCHAR := '0';
   w_transaction_date      DATE;
   TRAN_DATA               RECORD;
   w_tran_gl_code          VARCHAR := '0';
   w_contra_gl_code        VARCHAR := '0';
   w_cash_transaction      BOOLEAN;
   w_total_leg             INTEGER;
   w_total_debit_amount    NUMERIC (22, 2) := 0;
   w_total_credit_amount   NUMERIC (22, 2) := 0;
   w_available_balance     NUMERIC (22, 2) := 0;
   w_tran_amount           NUMERIC (22, 2) := 0;
   w_batch_serial          INTEGER := 0;
   w_day_serial_no         INTEGER := 0;
   w_tran_debit_credit     VARCHAR;
   w_status                VARCHAR;
   w_errm                  VARCHAR;
BEGIN
     SELECT count (batch_serial) + 1
               batch_serial,
            SUM (
               (CASE WHEN tran_debit_credit = 'D' THEN tran_amount ELSE 0 END))
               debit_amount,
            SUM (
               (CASE WHEN tran_debit_credit = 'C' THEN tran_amount ELSE 0 END))
               credit_amount
       INTO w_batch_serial, w_total_debit_amount, w_total_credit_amount
       FROM finance_transaction_table S
      WHERE S.branch_code = p_branch_code AND S.app_user_id = p_app_user_id
   ORDER BY batch_serial;

   BEGIN
      SELECT cash_gl_code
        INTO w_tran_gl_code
        FROM finance_application_settings;
   END;

   IF w_batch_serial > 0
   THEN
      FOR TRAN_DATA
         IN (  SELECT tran_gl_code,
                      account_number,
                      count (batch_serial) batch_serial,
                      SUM (
                         (CASE
                             WHEN tran_debit_credit = 'D' THEN tran_amount
                             ELSE 0
                          END)) debit_amount,
                      SUM (
                         (CASE
                             WHEN tran_debit_credit = 'C' THEN tran_amount
                             ELSE 0
                          END)) credit_amount
                 FROM finance_transaction_table S
                WHERE S.app_user_id = p_app_user_id
             GROUP BY S.tran_gl_code, s.account_number
             ORDER BY batch_serial)
      LOOP
         w_batch_serial := TRAN_DATA.batch_serial + 1;
         w_account_number := TRAN_DATA.account_number;

         IF TRAN_DATA.debit_amount > 0.00
         THEN
            w_tran_debit_credit := 'C';
            w_tran_amount := TRAN_DATA.debit_amount;
         ELSE
            w_tran_debit_credit := 'D';
            w_tran_amount := TRAN_DATA.credit_amount;
         END IF;

         IF w_account_number != '0'
         THEN
            BEGIN
               SELECT account_ledger_code
                 INTO STRICT w_contra_gl_code
                 FROM finance_accounts_balance
                WHERE account_number = w_account_number;
            EXCEPTION
               WHEN NO_DATA_FOUND
               THEN
                  RAISE EXCEPTION USING MESSAGE = 'Invalid Account Number!';
            END;

            w_account_number := '0';
         ---RAISE EXCEPTION USING MESSAGE = w_contra_gl_code;
         ELSE
            w_contra_gl_code := TRAN_DATA.tran_gl_code;
         END IF;

         IF w_tran_amount > 0
         THEN
            INSERT INTO finance_transaction_table (branch_code,
                                                   transaction_date,
                                                   batch_serial,
                                                   account_number,
                                                   tran_gl_code,
                                                   contra_gl_code,
                                                   tran_debit_credit,
                                                   tran_type,
                                                   tran_amount,
                                                   available_balance,
                                                   tran_person_phone,
                                                   tran_person_name,
                                                   tran_document_prefix,
                                                   tran_document_number,
                                                   tran_sign_verified,
                                                   system_posted_tran,
                                                   transaction_narration,
                                                   app_user_id,
                                                   app_data_time)
                 VALUES (p_branch_code,
                         p_tran_date,
                         w_batch_serial,
                         w_account_number,
                         p_transaction_ledger,
                         w_contra_gl_code,
                         w_tran_debit_credit,
                         p_transaction_type,
                         w_tran_amount,
                         0.00,
                         NULL,
                         NULL,
                         NULL,
                         NULL,
                         FALSE,
                         FALSE,
                         p_tran_narration,
                         p_app_user_id,
                         current_timestamp);
         END IF;
      END LOOP;

      SELECT *
        INTO w_status, w_errm, w_batch_number
        FROM fn_finance_post_tran (p_branch_code,
                                   p_app_user_id,
                                   p_transaction_type,
                                   p_tran_date,
                                   p_tran_narration,
                                   p_tran_source);

      IF w_tran_gl_code = p_transaction_ledger
      THEN
         BEGIN
            SELECT COALESCE (max (batch_number) + 1, 1)
             INTO w_day_serial_no
             FROM finance_cash_transaction
            WHERE     branch_code = p_branch_code
                  AND app_user_id = p_app_user_id
                  AND transaction_date = p_tran_date;

            INSERT INTO finance_cash_transaction (branch_code,
                                                  transaction_date,
                                                  batch_number,
                                                  day_serial_no,
                                                  receive_payment,
                                                  transaction_amount,
                                                  transaction_narration,
                                                  auth_by,
                                                  auth_on,
                                                  cancel_by,
                                                  cancel_on,
                                                  app_user_id,
                                                  app_data_time)
                 VALUES (p_branch_code,
                         p_tran_date,
                         w_batch_number,
                         w_day_serial_no,
                         p_receive_payment,
                         w_tran_amount,
                         p_tran_narration,
                         p_app_user_id,
                         current_timestamp,
                         NULL,
                         NULL,
                         p_app_user_id,
                         current_timestamp);
         END;
      END IF;

      o_batch_number := w_batch_number;
      o_status := w_status;
      o_errm := w_errm;
   END IF;
END;
$$;


ALTER FUNCTION public.fn_finance_post_cash_tran(p_branch_code integer, p_app_user_id character, p_transaction_type character, p_transaction_ledger character, p_tran_date date, p_tran_narration character, p_receive_payment character, p_tran_source character, OUT o_status character, OUT o_errm character, OUT o_batch_number character) OWNER TO jameaquasemia;

--
-- Name: fn_finance_post_tran(integer, character, character, date, character, character); Type: FUNCTION; Schema: public; Owner: jameaquasemia
--

CREATE FUNCTION public.fn_finance_post_tran(p_branch_code integer, p_app_user_id character, p_transaction_type character, p_tran_date date, p_tran_narration character, p_tran_source character, OUT o_status character, OUT o_errm character, OUT o_batch_number character) RETURNS record
    LANGUAGE plpgsql
    AS $$
DECLARE
   w_error_message             VARCHAR;
   w_batch_number              INTEGER;
   w_check                     BOOLEAN;
   w_account_number            VARCHAR := '0';
   w_transaction_date          DATE;
   w_last_balance_update       DATE;
   w_last_transaction_date     DATE;
   w_last_monbal_update        DATE;
   TRAN_DATA                   RECORD;
   w_tran_gl_code              VARCHAR := '0';
   w_cash_transaction          BOOLEAN;
   w_total_leg                 INTEGER;
   w_total_debit_amount        NUMERIC (22, 2) := 0;
   w_total_credit_amount       NUMERIC (22, 2) := 0;
   w_available_balance         NUMERIC (22, 2) := 0;
   w_new_credit_balance        NUMERIC (22, 2) := 0;
   w_new_debit_balance         NUMERIC (22, 2) := 0;
   w_new_available_balance     NUMERIC (22, 2) := 0;
   w_daily_credit_limit        NUMERIC (22, 2) := 0;
   w_daily_debit_limit         NUMERIC (22, 2) := 0;
   w_batch_serial              INTEGER := 0;
   w_status                    VARCHAR;
   w_errm                      VARCHAR;
   w_credit_limit              NUMERIC (22, 2) := 0;
   w_system_posted_tran        BOOL := FALSE;
   w_counter                   INTEGER := 0;
   w_branch_code               INTEGER := 0;
   w_cash_gl_code              VARCHAR;
   w_cash_user_id              VARCHAR;
   w_last_transaction_credit   DATE;
   w_last_transaction_debit    DATE;
BEGIN
   BEGIN
      SELECT COUNT (*)
        INTO w_total_leg
        FROM finance_transaction_table S
       WHERE S.app_user_id = p_app_user_id;
   END;

   IF w_total_leg = 0
   THEN
      w_status := 'E';
      w_errm := 'Nothing to Post.';
      RAISE EXCEPTION USING MESSAGE = w_errm;
   END IF;

   BEGIN
      SELECT COALESCE (max (batch_number) + 1, 1)
        INTO w_batch_number
        FROM finance_transaction_master
       WHERE branch_code = p_branch_code AND transaction_date = p_tran_date;
   END;

   BEGIN
      SELECT daily_credit_limit,
             daily_debit_limit,
             branch_code,
             cash_gl_code
        INTO w_daily_credit_limit,
             w_daily_debit_limit,
             w_branch_code,
             w_cash_gl_code
        FROM appauth_user_settings
       WHERE app_user_id = p_app_user_id;
   END;

   FOR TRAN_DATA
      IN (  SELECT branch_code,
                   COALESCE (acbrn_code, branch_code) acbrn_code,
                   transaction_date,
                   batch_serial,
                   account_number,
                   tran_gl_code,
                   contra_gl_code,
                   tran_debit_credit,
                   tran_type,
                   tran_amount,
                   COALESCE (principal_amount, 0.00) principal_amount,
                   COALESCE (profit_amount, 0.00) profit_amount,
                   COALESCE (charge_amount, 0.00) charge_amount,
                   (CASE
                       WHEN tran_debit_credit = 'D' THEN -tran_amount
                       ELSE tran_amount
                    END) balance_amount,
                   (CASE
                       WHEN tran_debit_credit = 'D' THEN tran_amount
                       ELSE 0
                    END) debit_amount,
                   (CASE
                       WHEN tran_debit_credit = 'C' THEN tran_amount
                       ELSE 0
                    END) credit_amount,
                   (CASE
                       WHEN tran_debit_credit = 'D'
                       THEN
                          COALESCE (principal_amount, 0.00)
                       ELSE
                          0
                    END) principal_debit_amount,
                   (CASE
                       WHEN tran_debit_credit = 'C'
                       THEN
                          COALESCE (principal_amount, 0.00)
                       ELSE
                          0
                    END) principal_credit_amount,
                   (CASE
                       WHEN tran_debit_credit = 'D'
                       THEN
                          COALESCE (profit_amount, 0.00)
                       ELSE
                          0
                    END) profit_debit_amount,
                   (CASE
                       WHEN tran_debit_credit = 'C'
                       THEN
                          COALESCE (profit_amount, 0.00)
                       ELSE
                          0
                    END) profit_credit_amount,
                   (CASE
                       WHEN tran_debit_credit = 'D'
                       THEN
                          COALESCE (charge_amount, 0.00)
                       ELSE
                          0
                    END) charge_debit_amount,
                   (CASE
                       WHEN tran_debit_credit = 'C'
                       THEN
                          COALESCE (charge_amount, 0.00)
                       ELSE
                          0
                    END) charge_credit_amount,
                   charge_code,
                   available_balance,
                   tran_document_prefix,
                   tran_document_number,
                   tran_person_phone,
                   tran_person_name,
                   tran_sign_verified,
                   system_posted_tran,
                   transaction_narration,
                   app_user_id,
                   app_data_time
              FROM finance_transaction_table S
             WHERE S.app_user_id = p_app_user_id
          ORDER BY batch_serial)
   LOOP
      w_account_number := TRAN_DATA.account_number;
      w_transaction_date := TRAN_DATA.transaction_date;
      w_tran_gl_code := TRAN_DATA.tran_gl_code;
      w_total_debit_amount := w_total_debit_amount + TRAN_DATA.debit_amount;
      w_total_credit_amount :=
         w_total_credit_amount + TRAN_DATA.credit_amount;
      w_batch_serial := w_batch_serial + 1;

      w_last_balance_update := NULL;
      w_last_transaction_date := NULL;

      IF w_account_number != '0'
      THEN
         BEGIN
            SELECT account_ledger_code
              INTO STRICT w_tran_gl_code
              FROM finance_accounts_balance
             WHERE account_number = w_account_number;
         EXCEPTION
            WHEN NO_DATA_FOUND
            THEN
               RAISE EXCEPTION USING MESSAGE = 'Invalid Account Number!';
         END;
      END IF;

      IF     COALESCE (TRAN_DATA.account_number, '0') = '0'
         AND COALESCE (TRAN_DATA.tran_gl_code, '0') = '0'
      THEN
         RAISE EXCEPTION
         USING MESSAGE =
                  'Posting Error Both ledger code and phone number can not be Zero!';
      END IF;

      IF     TRAN_DATA.tran_debit_credit = 'D'
         AND TRAN_DATA.debit_amount > w_daily_debit_limit
      THEN
         RAISE EXCEPTION
         USING MESSAGE =
                     'Your Transaction Limit '
                  || w_daily_debit_limit
                  || ' Will be Exceeded for This Transaction!';
      END IF;

      IF     TRAN_DATA.tran_debit_credit = 'C'
         AND TRAN_DATA.credit_amount > w_daily_credit_limit
      THEN
         RAISE EXCEPTION
         USING MESSAGE =
                     'Your Transaction Limit '
                  || w_daily_credit_limit
                  || ' Will be Exceeded for This Transaction!';
      END IF;

      IF w_tran_gl_code != '0'
      THEN
         BEGIN
            SELECT gl_code
              INTO STRICT w_tran_gl_code
              FROM finance_general_ledger
             WHERE gl_code = w_tran_gl_code;
         EXCEPTION
            WHEN NO_DATA_FOUND
            THEN
               RAISE EXCEPTION
               USING MESSAGE =
                           'Posting Error Invalid Ledger Code! '
                        || w_tran_gl_code;
         END;

         BEGIN
            SELECT gl_balance,
                   COALESCE (last_balance_update, w_transaction_date)
                      last_balance_update,
                   COALESCE (last_transaction_date, w_transaction_date)
                      last_transaction_date,
                   COALESCE (last_monbal_update, w_transaction_date)
                      last_monbal_update
              INTO STRICT w_available_balance,
                          w_last_balance_update,
                          w_last_transaction_date,
                          w_last_monbal_update
              FROM finance_ledger_balance
             WHERE     branch_code = TRAN_DATA.acbrn_code
                   AND gl_code = w_tran_gl_code;

            w_last_balance_update :=
               LEAST (w_last_balance_update, w_transaction_date);
            w_last_transaction_date :=
               GREATEST (w_last_transaction_date, w_transaction_date);
            w_last_monbal_update :=
               LEAST (w_last_monbal_update, w_transaction_date);

            UPDATE finance_ledger_balance
               SET gl_balance = gl_balance + TRAN_DATA.balance_amount,
                   total_debit_sum = total_debit_sum + TRAN_DATA.debit_amount,
                   total_credit_sum =
                      total_credit_sum + TRAN_DATA.credit_amount,
                   last_balance_update = w_last_balance_update,
                   last_transaction_date = w_last_transaction_date,
                   last_monbal_update = w_last_monbal_update,
                   is_balance_updated = FALSE,
                   is_monbal_updated = FALSE,
                   is_monbal_recpay_updated = FALSE
             WHERE     branch_code = TRAN_DATA.acbrn_code
                   AND gl_code = w_tran_gl_code;

            UPDATE finance_cash_and_bank_ledger
               SET last_balance_update = w_last_balance_update,
                   last_transaction_date = w_last_transaction_date,
                   is_balance_updated = FALSE
             WHERE     branch_code = TRAN_DATA.acbrn_code
                   AND gl_code = w_tran_gl_code;

            w_available_balance :=
               w_available_balance + TRAN_DATA.balance_amount;
         EXCEPTION
            WHEN NO_DATA_FOUND
            THEN
               INSERT INTO finance_ledger_balance (branch_code,
                                                   gl_code,
                                                   last_transaction_date,
                                                   last_balance_update,
                                                   is_balance_updated,
                                                   is_monbal_updated,
                                                   is_monbal_recpay_updated,
                                                   total_debit_sum,
                                                   total_credit_sum,
                                                   gl_balance,
                                                   unauth_debit_sum,
                                                   unauth_credit_sum,
                                                   transfer_debit_sum,
                                                   transfer_credit_sum,
                                                   auth_by,
                                                   auth_on,
                                                   cancel_by,
                                                   cancel_on,
                                                   app_user_id,
                                                   app_data_time)
                    VALUES (TRAN_DATA.acbrn_code,
                            w_tran_gl_code,
                            w_transaction_date,
                            w_transaction_date,
                            FALSE,
                            FALSE,
                            FALSE,
                            TRAN_DATA.debit_amount,
                            TRAN_DATA.credit_amount,
                            TRAN_DATA.balance_amount,
                            0.00,
                            0.00,
                            0.00,
                            0.00,
                            NULL,
                            NULL,
                            NULL,
                            NULL,
                            p_app_user_id,
                            current_timestamp);

               w_available_balance := TRAN_DATA.balance_amount;
         END;
      END IF;

      IF TRAN_DATA.system_posted_tran
      THEN
         w_system_posted_tran := TRUE;
      END IF;

      IF w_account_number != '0'
      THEN
         BEGIN
            SELECT COALESCE (account_balance, 0),
                   COALESCE (credit_limit, 0),
                   COALESCE (last_balance_update, w_transaction_date)
                      last_balance_update,
                   COALESCE (last_transaction_date, w_transaction_date)
                      last_transaction_date,
                   COALESCE (last_monbal_update, w_transaction_date)
                      last_monbal_update,
                   last_transaction_credit,
                   last_transaction_debit
              INTO STRICT w_available_balance,
                          w_credit_limit,
                          w_last_balance_update,
                          w_last_transaction_date,
                          w_last_monbal_update,
                          w_last_transaction_credit,
                          w_last_transaction_debit
              FROM finance_accounts_balance
             WHERE account_number = w_account_number;
         EXCEPTION
            WHEN NO_DATA_FOUND
            THEN
               RAISE EXCEPTION
               USING MESSAGE = 'Invalid Account Number !' || w_account_number;
         END;


         IF TRAN_DATA.tran_debit_credit = 'C'
         THEN
            w_last_transaction_credit :=
               GREATEST (w_last_transaction_credit, w_transaction_date);
         END IF;

         IF TRAN_DATA.tran_debit_credit = 'D'
         THEN
            w_last_transaction_debit :=
               GREATEST (w_last_transaction_debit, w_transaction_date);
         END IF;

         w_last_transaction_date :=
            GREATEST (w_last_transaction_date, w_transaction_date);
         w_last_balance_update :=
            least (w_last_balance_update, w_transaction_date);
         w_last_monbal_update :=
            LEAST (w_last_monbal_update, w_transaction_date);

         UPDATE finance_accounts_balance
            SET account_balance = account_balance + TRAN_DATA.balance_amount,
                total_debit_amount =
                   total_debit_amount + TRAN_DATA.debit_amount,
                total_credit_amount =
                   total_credit_amount + TRAN_DATA.credit_amount,
                principal_debit =
                   principal_debit + TRAN_DATA.principal_debit_amount,
                principal_credit =
                   principal_credit + TRAN_DATA.principal_credit_amount,
                profit_debit = profit_debit + TRAN_DATA.profit_debit_amount,
                profit_credit =
                   profit_credit + TRAN_DATA.profit_credit_amount,
                charge_debit = charge_debit + TRAN_DATA.charge_debit_amount,
                charge_credit =
                   charge_credit + TRAN_DATA.charge_credit_amount,
                last_balance_update = w_last_balance_update,
                last_transaction_date = w_last_transaction_date,
                last_monbal_update = w_last_monbal_update,
                is_balance_updated = FALSE,
                last_transaction_debit = w_last_transaction_debit,
                last_transaction_credit = w_last_transaction_credit
          WHERE account_number = w_account_number;

         BEGIN
            SELECT sum (tran_amount)
             INTO w_new_credit_balance
             FROM finance_transaction_table S
            WHERE     S.branch_code = p_branch_code
                  AND S.app_user_id = p_app_user_id
                  AND s.account_number = w_account_number
                  AND s.tran_debit_credit = 'C';
         END;

         BEGIN
            SELECT sum (tran_amount)
             INTO w_new_debit_balance
             FROM finance_transaction_table S
            WHERE     S.branch_code = p_branch_code
                  AND S.app_user_id = p_app_user_id
                  AND s.account_number = w_account_number
                  AND s.tran_debit_credit = 'D';
         END;

         w_new_available_balance :=
            w_new_credit_balance - w_new_debit_balance;

         -- w_errm:= w_available_balance||' . '||TRAN_DATA.tran_amount||TRAN_DATA.tran_debit_credit||' . '||w_credit_limit;
         -- w_status := 'E';
         -- RAISE EXCEPTION USING MESSAGE = w_errm;

         IF     TRAN_DATA.tran_debit_credit = 'D'
            AND (w_available_balance) < TRAN_DATA.tran_amount
         THEN
            IF    w_credit_limit < abs (w_available_balance)
               OR w_credit_limit = 0
            THEN
               w_status := 'E';
               w_errm :=
                     'Credit Limit ('
                  || w_available_balance
                  || ') Exceed For This Transaction!';
               RAISE EXCEPTION USING MESSAGE = w_errm;
            END IF;
         END IF;
      END IF;


      IF w_cash_gl_code = w_tran_gl_code
      THEN
         BEGIN
            SELECT teller_id
              INTO STRICT w_cash_user_id
              FROM finance_transaction_telbal
             WHERE teller_id = p_app_user_id;

            UPDATE finance_transaction_telbal
               SET total_credit_amount =
                      total_credit_amount + TRAN_DATA.credit_amount,
                   total_debit_amount =
                      total_debit_amount + TRAN_DATA.debit_amount,
                   cash_balance = cash_balance + TRAN_DATA.balance_amount,
                   last_balance_update = w_last_balance_update,
                   last_transaction_date = w_last_transaction_date,
                   is_balance_updated = FALSE
             WHERE teller_id = p_app_user_id;
         EXCEPTION
            WHEN NO_DATA_FOUND
            THEN
               INSERT INTO finance_transaction_telbal (branch_code,
                                                       teller_id,
                                                       cash_od_allowed,
                                                       is_balance_updated,
                                                       credit_limit_amount,
                                                       debit_limit_amount,
                                                       total_credit_amount,
                                                       total_debit_amount,
                                                       cash_balance,
                                                       last_balance_update,
                                                       last_transaction_date,
                                                       app_user_id,
                                                       app_data_time)
                    VALUES (p_branch_code,
                            p_app_user_id,
                            FALSE,
                            FALSE,
                            999999999999999.00,
                            999999999999999.00,
                            TRAN_DATA.credit_amount,
                            TRAN_DATA.debit_amount,
                            TRAN_DATA.balance_amount,
                            w_last_balance_update,
                            w_last_transaction_date,
                            p_app_user_id,
                            current_timestamp);
         END;
      END IF;

      INSERT INTO finance_transaction_details (branch_code,
                                               acbrn_code,
                                               transaction_date,
                                               batch_number,
                                               batch_serial,
                                               account_number,
                                               tran_gl_code,
                                               contra_gl_code,
                                               tran_debit_credit,
                                               tran_type,
                                               tran_amount,
                                               principal_amount,
                                               profit_amount,
                                               charge_amount,
                                               charge_code,
                                               cancel_amount,
                                               available_balance,
                                               tran_document_prefix,
                                               tran_document_number,
                                               tran_person_phone,
                                               tran_person_name,
                                               tran_sign_verified,
                                               system_posted_tran,
                                               transaction_narration,
                                               auth_by,
                                               auth_on,
                                               cancel_by,
                                               cancel_on,
                                               app_user_id,
                                               app_data_time)
           VALUES (p_branch_code,
                   TRAN_DATA.acbrn_code,
                   p_tran_date,
                   w_batch_number,
                   w_batch_serial,
                   w_account_number,
                   w_tran_gl_code,
                   TRAN_DATA.contra_gl_code,
                   TRAN_DATA.tran_debit_credit,
                   TRAN_DATA.tran_type,
                   TRAN_DATA.tran_amount,
                   TRAN_DATA.principal_amount,
                   TRAN_DATA.profit_amount,
                   TRAN_DATA.charge_amount,
                   TRAN_DATA.charge_code,
                   0,
                   w_available_balance,
                   TRAN_DATA.tran_document_prefix,
                   TRAN_DATA.tran_document_number,
                   TRAN_DATA.tran_person_phone,
                   TRAN_DATA.tran_person_name,
                   TRAN_DATA.tran_sign_verified,
                   TRAN_DATA.system_posted_tran,
                   TRAN_DATA.transaction_narration,
                   p_app_user_id,
                   current_timestamp,
                   NULL,
                   NULL,
                   p_app_user_id,
                   current_timestamp);
   /*
         IF w_account_number != '0'
         THEN
            SELECT w_status, w_errm
              INTO w_status, w_errm
              FROM fn_finance_acbal_hist (w_account_number,
                                          w_last_transaction_date);

            IF w_status = 'E'
            THEN
               RAISE EXCEPTION USING MESSAGE = w_errm;
            END IF;
         END IF;

         IF w_tran_gl_code != '0'
         THEN
            SELECT w_status, w_errm
              INTO w_status, w_errm
              FROM fn_finance_glbal_hist (w_tran_gl_code,
                                          p_branch_code,
                                          w_last_transaction_date);

            IF w_status = 'E'
            THEN
               RAISE EXCEPTION USING MESSAGE = w_errm;
            END IF;

            SELECT w_status, w_errm
              INTO w_status, w_errm
              FROM fn_finance_glmonbal_hist (w_tran_gl_code,
                                             p_branch_code,
                                             w_last_transaction_date);

            IF w_status = 'E'
            THEN
               RAISE EXCEPTION USING MESSAGE = w_errm;
            END IF;
         END IF;
         */
   END LOOP;

   IF w_total_debit_amount != w_total_credit_amount
   THEN
      w_status := 'E';
      w_errm :=
            'Total Debit ('
         || w_total_debit_amount
         || ') and Credit Amount ('
         || w_total_credit_amount
         || ') Must Be Same';
      RAISE EXCEPTION USING MESSAGE = w_errm;
   END IF;

   BEGIN
      INSERT INTO finance_transaction_master (branch_code,
                                              transaction_date,
                                              batch_number,
                                              tran_type,
                                              total_debit_amount,
                                              total_credit_amount,
                                              tran_source_table,
                                              tran_source_key,
                                              transaction_narration,
                                              system_posted_tran,
                                              auth_by,
                                              auth_on,
                                              cancel_by,
                                              cancel_on,
                                              app_user_id,
                                              app_data_time)
           VALUES (p_branch_code,
                   p_tran_date,
                   w_batch_number,
                   p_transaction_type,
                   w_total_debit_amount,
                   w_total_credit_amount,
                   p_tran_source,
                   'NA',
                   p_tran_narration,
                   w_system_posted_tran,
                   p_app_user_id,
                   current_timestamp,
                   NULL,
                   NULL,
                   p_app_user_id,
                   current_timestamp);
   END;

   BEGIN
      DELETE FROM finance_transaction_table S
            WHERE S.app_user_id = p_app_user_id;
   END;

   o_batch_number := w_batch_number;
   o_status := 'S';
   o_errm := '';
EXCEPTION
   WHEN OTHERS
   THEN
      IF w_status = 'E'
      THEN
         o_status := w_status;
         o_errm := w_errm;
         o_batch_number := 0;
      ELSE
         o_errm := SQLERRM;
         o_status := 'E';
         o_batch_number := 0;
      END IF;
END;
$$;


ALTER FUNCTION public.fn_finance_post_tran(p_branch_code integer, p_app_user_id character, p_transaction_type character, p_tran_date date, p_tran_narration character, p_tran_source character, OUT o_status character, OUT o_errm character, OUT o_batch_number character) OWNER TO jameaquasemia;

--
-- Name: fn_finance_post_tran_cancel(integer, character, date, integer, character); Type: FUNCTION; Schema: public; Owner: jameaquasemia
--

CREATE FUNCTION public.fn_finance_post_tran_cancel(p_branch_code integer, p_app_user_id character, p_tran_date date, p_batch_number integer, p_cancel_reason character, OUT o_status character, OUT o_errm character) RETURNS record
    LANGUAGE plpgsql
    AS $$
DECLARE
   w_error_message           VARCHAR;
   w_status                  VARCHAR;
   w_batch_number            INTEGER;
   w_check                   BOOLEAN;
   w_account_number          VARCHAR := '0';
   w_transaction_date        DATE;
   w_last_balance_update     DATE;
   w_last_transaction_date   DATE;
   w_last_monbal_update      DATE;
   TRAN_DATA                 RECORD;
   w_tran_gl_code            VARCHAR := '0';
   w_cash_gl_code            VARCHAR := '0';
   w_cash_transaction        BOOLEAN;
   w_total_leg               INTEGER;
   w_total_debit_amount      NUMERIC (22, 2) := 0;
   w_total_credit_amount     NUMERIC (22, 2) := 0;
   w_available_balance       NUMERIC (22, 2) := 0;
   w_batch_serial            INTEGER := 0;
   w_counter                 INTEGER := 0;
BEGIN
   BEGIN
      SELECT count (1)
       INTO w_counter
       FROM finance_transaction_details S
      WHERE     S.branch_code = p_branch_code
            AND s.transaction_date = p_tran_date
            AND s.batch_number = p_batch_number;
   END;

   IF w_counter = 0
   THEN
      RAISE EXCEPTION USING MESSAGE = 'Invalid Batch Information';
   END IF;

   w_counter := 0;

   BEGIN
      SELECT cash_gl_code
        INTO STRICT w_cash_gl_code
        FROM finance_application_settings;
   EXCEPTION
      WHEN NO_DATA_FOUND
      THEN
         RAISE EXCEPTION USING MESSAGE = 'Invalid Cash Ledger Code!';
   END;

   FOR TRAN_DATA
      IN (  SELECT branch_code,
                   transaction_date,
                   batch_serial,
                   account_number,
                   tran_gl_code,
                   contra_gl_code,
                   tran_debit_credit,
                   tran_type,
                   tran_amount,
                   (CASE
                       WHEN tran_debit_credit = 'C' THEN -tran_amount
                       ELSE tran_amount
                    END) balance_amount,
                   (CASE
                       WHEN tran_debit_credit = 'D' THEN -tran_amount
                       ELSE 0
                    END) debit_amount,
                   (CASE
                       WHEN tran_debit_credit = 'C' THEN -tran_amount
                       ELSE 0
                    END) credit_amount,
                   available_balance,
                   tran_document_prefix,
                   tran_document_number,
                   tran_person_phone,
                   tran_person_name,
                   tran_sign_verified,
                   system_posted_tran,
                   transaction_narration,
                   app_user_id,
                   app_data_time
              FROM finance_transaction_details S
             WHERE     S.branch_code = p_branch_code
                   AND s.transaction_date = p_tran_date
                   AND s.batch_number = p_batch_number
                   AND s.cancel_by IS NULL
          ORDER BY batch_serial)
   LOOP
      w_account_number := TRAN_DATA.account_number;
      w_transaction_date := TRAN_DATA.transaction_date;
      w_tran_gl_code := TRAN_DATA.tran_gl_code;
      w_total_debit_amount := w_total_debit_amount + TRAN_DATA.debit_amount;
      w_total_credit_amount :=
         w_total_credit_amount + TRAN_DATA.credit_amount;
      w_batch_serial := w_batch_serial + 1;
      w_counter := w_counter + 1;

      IF w_tran_gl_code != '0'
      THEN
         BEGIN
            SELECT gl_balance,
                   COALESCE (last_balance_update, w_transaction_date)
                      last_balance_update,
                   COALESCE (last_transaction_date, w_transaction_date)
                      last_transaction_date,
                   COALESCE (last_monbal_update, w_transaction_date)
                      last_monbal_update
              INTO STRICT w_available_balance,
                          w_last_balance_update,
                          w_last_transaction_date,
                          w_last_monbal_update
              FROM finance_ledger_balance
             WHERE     branch_code = TRAN_DATA.branch_code
                   AND gl_code = w_tran_gl_code;

            w_last_balance_update :=
               LEAST (w_last_balance_update, w_transaction_date);
            w_last_transaction_date :=
               GREATEST (w_last_transaction_date, w_transaction_date);
            w_last_monbal_update :=
               LEAST (w_last_monbal_update, w_transaction_date);

            UPDATE finance_ledger_balance
               SET gl_balance = gl_balance + TRAN_DATA.balance_amount,
                   total_debit_sum = total_debit_sum + TRAN_DATA.debit_amount,
                   total_credit_sum =
                      total_credit_sum + TRAN_DATA.credit_amount,
                   last_balance_update = w_last_balance_update,
                   last_transaction_date = w_last_transaction_date,
                   last_monbal_update = w_last_monbal_update,
                   is_balance_updated = FALSE,
                   is_monbal_updated = FALSE,
                   is_monbal_recpay_updated = FALSE
             WHERE     branch_code = TRAN_DATA.branch_code
                   AND gl_code = w_tran_gl_code;

            UPDATE finance_cash_and_bank_ledger
               SET last_balance_update = w_last_balance_update,
                   last_transaction_date = w_last_transaction_date,
                   is_balance_updated = FALSE
             WHERE     branch_code = TRAN_DATA.branch_code
                   AND gl_code = w_tran_gl_code;

            DELETE FROM
               finance_ledger_balance_hist
                  WHERE     gl_code = w_tran_gl_code
                        AND transaction_date = w_transaction_date
                        AND branch_code = TRAN_DATA.branch_code;

            DELETE FROM
               finance_led_rec_pay_bal_hist
                  WHERE     gl_code = TRAN_DATA.contra_gl_code
                        AND transaction_date = w_transaction_date
                        AND branch_code = TRAN_DATA.branch_code;

            IF w_cash_gl_code = w_tran_gl_code
            THEN
               BEGIN
                  UPDATE finance_transaction_telbal
                     SET total_credit_amount =
                            total_credit_amount + TRAN_DATA.credit_amount,
                         total_debit_amount =
                            total_debit_amount + TRAN_DATA.debit_amount,
                         cash_balance =
                            cash_balance + TRAN_DATA.balance_amount
                   WHERE teller_id = TRAN_DATA.app_user_id;
               END;
            END IF;
         END;
      END IF;

      IF w_account_number != '0'
      THEN
         BEGIN
            SELECT COALESCE (account_balance, 0),
                   COALESCE (last_balance_update, w_transaction_date)
                      last_balance_update,
                   COALESCE (last_transaction_date, w_transaction_date)
                      last_transaction_date,
                   COALESCE (last_monbal_update, w_transaction_date)
                      last_monbal_update
              INTO STRICT w_available_balance,
                          w_last_balance_update,
                          w_last_transaction_date,
                          w_last_monbal_update
              FROM finance_accounts_balance
             WHERE account_number = w_account_number;
         EXCEPTION
            WHEN NO_DATA_FOUND
            THEN
               RAISE EXCEPTION
               USING MESSAGE = 'Invalid Account Number !' || w_account_number;
         END;

         w_last_transaction_date :=
            GREATEST (w_last_transaction_date, w_transaction_date);
         w_last_balance_update :=
            least (w_last_balance_update, w_transaction_date);
         w_last_monbal_update :=
            LEAST (w_last_monbal_update, w_transaction_date);

         UPDATE finance_accounts_balance
            SET account_balance = account_balance + TRAN_DATA.balance_amount,
                total_debit_amount =
                   total_debit_amount + TRAN_DATA.debit_amount,
                total_credit_amount =
                   total_credit_amount + TRAN_DATA.credit_amount,
                last_balance_update = w_last_balance_update,
                last_transaction_date = w_last_transaction_date,
                last_monbal_update = w_last_monbal_update,
                is_balance_updated = FALSE
          WHERE account_number = w_account_number;

         DELETE FROM
            finance_accounts_balance_hist
               WHERE     account_number = w_account_number
                     AND transaction_date = w_transaction_date;
      END IF;

      BEGIN
         UPDATE finance_transaction_details S
            SET cancel_amount = tran_amount,
                cancel_by = p_app_user_id,
                cancel_on = current_timestamp,
                cancel_remarks = p_cancel_reason
          WHERE     S.branch_code = p_branch_code
                AND s.transaction_date = p_tran_date
                AND s.batch_number = p_batch_number;

         UPDATE finance_transaction_master M
            SET cancel_by = p_app_user_id,
                cancel_on = current_timestamp,
                cancel_remarks = p_cancel_reason
          WHERE     M.branch_code = p_branch_code
                AND M.transaction_date = p_tran_date
                AND M.batch_number = p_batch_number;

         UPDATE finance_cash_transaction M
            SET cancel_by = p_app_user_id,
                cancel_on = current_timestamp,
                cancel_remarks = p_cancel_reason
          WHERE     M.branch_code = p_branch_code
                AND M.transaction_date = p_tran_date
                AND M.batch_number = p_batch_number;
      END;
   END LOOP;

   IF w_counter = 0
   THEN
      RAISE EXCEPTION USING MESSAGE = 'Batch Already Canceled!';
   END IF;

   o_status := 'S';
   o_errm := '';
EXCEPTION
   WHEN OTHERS
   THEN
      IF w_status = 'E'
      THEN
         o_status := w_status;
         o_errm := w_error_message;
      ELSE
         o_errm := SQLERRM;
         o_status := 'E';
      END IF;
END;
$$;


ALTER FUNCTION public.fn_finance_post_tran_cancel(p_branch_code integer, p_app_user_id character, p_tran_date date, p_batch_number integer, p_cancel_reason character, OUT o_status character, OUT o_errm character) OWNER TO jameaquasemia;

--
-- Name: fn_finance_query_account_statement(character, date, date, character); Type: FUNCTION; Schema: public; Owner: jameaquasemia
--

CREATE FUNCTION public.fn_finance_query_account_statement(p_account_number character, p_from_date date, p_upto_date date, p_app_user_id character, OUT o_status character, OUT o_errm character) RETURNS record
    LANGUAGE plpgsql
    AS $$
DECLARE
   w_status                  VARCHAR;
   w_counter                 INTEGER;
   w_errm                    VARCHAR;
   w_last_transaction_date   DATE;
   w_account_number          VARCHAR;
   w_account_title           VARCHAR;
   w_account_balance         NUMERIC (22, 2) := 0;
BEGIN
   SELECT count (account_number)
     INTO w_counter
     FROM finance_accounts_balance
    WHERE account_number = p_account_number;

   IF w_counter = 0
   THEN
      RAISE EXCEPTION USING MESSAGE = 'Invalid Account Number!';
   END IF;

   SELECT account_number,
          account_title,
          account_balance,
          last_transaction_date
     INTO w_account_number,
          w_account_title,
          w_account_balance,
          w_last_transaction_date
     FROM finance_accounts_balance
    WHERE account_number = p_account_number;

   SELECT w_status, w_errm
     INTO w_status, w_errm
     FROM fn_finance_acbal_hist (p_account_number, w_last_transaction_date);

   DELETE FROM appauth_query_table
         WHERE app_user_id = p_app_user_id;

   INSERT INTO appauth_query_table (chr_column1,
                                    chr_column3,
                                    chr_column4,
                                    dec_column4,
                                    dat_column1,
                                    chr_column2,
                                    dec_column1,
                                    dec_column2,
                                    dec_column3,
                                    app_user_id)
      SELECT serial_number,
             w_account_number,
             w_account_title,
             w_account_balance,
             transaction_date,
             transaction_narration,
             credit_balance,
             debit_balance,
             SUM (credit_balance - debit_balance)
                OVER (ORDER BY serial_number) account_balance,
             p_app_user_id
        FROM (SELECT 1  serial_number,
                     p_from_date - 1 transaction_date,
                     'Opening Balance' transaction_narration,
                     (CASE
                         WHEN o_account_balance > 0 THEN o_account_balance
                         ELSE 0
                      END) credit_balance,
                     (CASE
                         WHEN o_account_balance < 0
                         THEN
                            abs (o_account_balance)
                         ELSE
                            0
                      END) debit_balance
                FROM fn_finance_get_ason_acbal (p_account_number,
                                                p_from_date - 1)
              UNION ALL
              SELECT   (ROW_NUMBER ()
                        OVER (
                           ORDER BY
                              transaction_date, batch_number, batch_serial))
                     + 1 serial_number,
                     transaction_date,
                     transaction_narration,
                     (CASE
                         WHEN tran_debit_credit = 'C' THEN tran_amount
                         ELSE 0
                      END) credit_balance,
                     (CASE
                         WHEN tran_debit_credit = 'D' THEN tran_amount
                         ELSE 0
                      END) debit_balance
                FROM finance_transaction_details
               WHERE     account_number = p_account_number
                     AND cancel_by IS NULL
                     AND transaction_date BETWEEN p_from_date AND p_upto_date)
             a;

   o_status := 'S';
   o_errm := '';
EXCEPTION
   WHEN OTHERS
   THEN
      IF w_status = 'E'
      THEN
         o_status := w_status;
         o_errm := w_errm;
      ELSE
         o_errm := SQLERRM;
         o_status := 'E';
      END IF;
END;
$$;


ALTER FUNCTION public.fn_finance_query_account_statement(p_account_number character, p_from_date date, p_upto_date date, p_app_user_id character, OUT o_status character, OUT o_errm character) OWNER TO jameaquasemia;

--
-- Name: fn_finance_query_daily_transaction(integer, date, date, character, character, character); Type: FUNCTION; Schema: public; Owner: jameaquasemia
--

CREATE FUNCTION public.fn_finance_query_daily_transaction(p_branch_code integer, p_from_date date, p_upto_date date, p_account_number character, p_tran_gl_code character, p_app_user_id character, OUT o_status character, OUT o_errm character) RETURNS record
    LANGUAGE plpgsql
    AS $$
DECLARE
   w_errm        VARCHAR;
   w_status      VARCHAR;
   w_sql_stat    TEXT := '';
   w_ason_date   DATE;
   w_from_date   DATE;
   w_upto_date   DATE;
BEGIN
   IF p_from_date = p_upto_date
   THEN
      w_ason_date := p_from_date;
   ELSE
      w_from_date := p_from_date;
      w_upto_date := p_upto_date;
   END IF;

   DELETE FROM appauth_query_table
         WHERE app_user_id = p_app_user_id;

   IF p_account_number <> '0'
   THEN
      w_sql_stat :=
            'INSERT INTO appauth_query_table (int_column1,
                                  dat_column1,
                                  int_column2,
                                  chr_column1,
                                  chr_column2,
                                  chr_column3,
                                  chr_column4,
                                  chr_column5,
                                  dec_column1,
                                  dec_column2,
                                  chr_column6,
                                  chr_column7,
                                  chr_column8,
                                  dat_column2,
                                  chr_column9,
                                  dat_column3,
                                  app_user_id)
      SELECT t.branch_code,
             t.transaction_date,
             t.batch_number,
             t.tran_gl_code,
             l.gl_name,
             t.account_number,
             a.account_title account_name,
             (case when t.tran_debit_credit=''C'' then ''Payment'' else ''Receipt'' end) tran_debit_credit,
             t.tran_amount,
             t.cancel_amount,
             t.tran_document_number,
             t.transaction_narration,
             t.cancel_by,
             t.cancel_on,
             t.app_user_id,
             t.app_data_time,
             '''
         || p_app_user_id
         || '''
        FROM finance_transaction_details t, finance_general_ledger l, finance_accounts_balance a
       WHERE t.tran_gl_code = l.gl_code 
       and a.account_number=t.account_number
       and a.account_number= '''
         || p_account_number
         || '''';
   ELSIF p_tran_gl_code <> '0'
   THEN
      w_sql_stat :=
            'INSERT INTO appauth_query_table (int_column1,
                                  dat_column1,
                                  int_column2,
                                  chr_column1,
                                  chr_column2,
                                  chr_column3,
                                  chr_column4,
                                  chr_column5,
                                  dec_column1,
                                  dec_column2,
                                  chr_column6,
                                  chr_column7,
                                  chr_column8,
                                  dat_column2,
                                  chr_column9,
                                  dat_column3,
                                  app_user_id)
      SELECT t.branch_code,
             t.transaction_date,
             t.batch_number,
             t.tran_gl_code,
             l.gl_name,
             t.account_number,
             '' '' account_name,
             (case when t.tran_debit_credit=''C'' then ''Payment'' else ''Receipt'' end) tran_debit_credit,
             t.tran_amount,
             t.cancel_amount,
             t.tran_document_number,
             t.transaction_narration,
             t.cancel_by,
             t.cancel_on,
             t.app_user_id,
             t.app_data_time,
             '''
         || p_app_user_id
         || '''
        FROM finance_transaction_details t, finance_general_ledger l
       WHERE t.tran_gl_code = l.gl_code ';
   END IF;

   IF p_account_number <> '0' OR p_tran_gl_code <> '0'
   THEN
      IF p_tran_gl_code <> '0'
      THEN
         w_sql_stat :=
               w_sql_stat
            || ' and t.tran_gl_code = '''
            || p_tran_gl_code
            || '''';
      END IF;

      IF w_from_date IS NOT NULL AND w_upto_date IS NOT NULL
      THEN
         w_sql_stat :=
               w_sql_stat
            || ' and t.transaction_date between '''
            || w_from_date
            || ''' and '''
            || w_upto_date
            || '''';
      END IF;

      IF w_ason_date IS NOT NULL
      THEN
         w_sql_stat :=
               w_sql_stat
            || ' and t.transaction_date = '''
            || w_ason_date
            || '''';
      END IF;

      IF p_branch_code IS NOT NULL
      THEN
         w_sql_stat := w_sql_stat || ' and t.branch_code = ' || p_branch_code;
      END IF;


      --RAISE EXCEPTION USING MESSAGE = w_sql_stat;

      EXECUTE w_sql_stat;
   END IF;

   o_status := 'S';
   o_errm := '';
EXCEPTION
   WHEN OTHERS
   THEN
      IF w_status = 'E'
      THEN
         o_status := w_status;
         o_errm := w_errm;
      ELSE
         o_errm := SQLERRM;
         o_status := 'E';
      END IF;
END;
$$;


ALTER FUNCTION public.fn_finance_query_daily_transaction(p_branch_code integer, p_from_date date, p_upto_date date, p_account_number character, p_tran_gl_code character, p_app_user_id character, OUT o_status character, OUT o_errm character) OWNER TO jameaquasemia;

--
-- Name: fn_finance_query_ledger_statement(character, integer, date, date, character); Type: FUNCTION; Schema: public; Owner: jameaquasemia
--

CREATE FUNCTION public.fn_finance_query_ledger_statement(p_gl_code character, p_branch_code integer, p_from_date date, p_upto_date date, p_app_user_id character, OUT o_status character, OUT o_errm character) RETURNS record
    LANGUAGE plpgsql
    AS $$
DECLARE
   w_status                 VARCHAR;
   w_counter                INTEGER;
   w_errm                   VARCHAR;
   w_gl_name                VARCHAR;
   w_current_business_day   DATE;
   w_gl_balance             NUMERIC (20, 2);
BEGIN
   SELECT count (gl_code)
     INTO w_counter
     FROM finance_general_ledger
    WHERE gl_code = p_gl_code;

   DELETE FROM appauth_query_table
         WHERE app_user_id = p_app_user_id;

   IF w_counter = 0
   THEN
      RAISE EXCEPTION USING MESSAGE = 'Invalid Ledger Code!';
   END IF;

   --    RAISE EXCEPTION USING MESSAGE = p_branch_code;

   SELECT gl_name
     INTO w_gl_name
     FROM finance_general_ledger
    WHERE gl_code = p_gl_code;

   IF p_branch_code = 0
   THEN
      INSERT INTO appauth_query_table (chr_column1,
                                       dat_column1,
                                       chr_column2,
                                       dec_column1,
                                       dec_column2,
                                       dec_column3,
                                       app_user_id)
           SELECT serial_number,
                  transaction_date,
                  transaction_narration,
                  credit_balance,
                  debit_balance,
                  SUM (credit_balance - debit_balance)
                     OVER (ORDER BY serial_number) ledger_balance,
                  p_app_user_id
             FROM (SELECT 1  serial_number,
                          p_from_date - 1 transaction_date,
                          'Opening Balance' transaction_narration,
                          (CASE
                              WHEN o_gl_balance > 0 THEN o_gl_balance
                              ELSE 0
                           END) credit_balance,
                          (CASE
                              WHEN o_gl_balance < 0 THEN abs (o_gl_balance)
                              ELSE 0
                           END) debit_balance
                     FROM fn_finance_get_ason_glbal (p_branch_code,
                                                     p_gl_code,
                                                     p_from_date - 1)
                   UNION ALL
                   SELECT   (ROW_NUMBER ()
                             OVER (
                                ORDER BY
                                   transaction_date, batch_number, batch_serial))
                          + 1 serial_number,
                          transaction_date,
                          transaction_narration,
                          (CASE
                              WHEN tran_debit_credit = 'C' THEN tran_amount
                              ELSE 0
                           END) credit_balance,
                          (CASE
                              WHEN tran_debit_credit = 'D' THEN tran_amount
                              ELSE 0
                           END) debit_balance
                     FROM finance_transaction_details
                    WHERE     tran_gl_code = p_gl_code
                          AND transaction_date BETWEEN p_from_date
                                                   AND p_upto_date) a
         ORDER BY serial_number;

      SELECT sum (gl_balance)
        INTO w_gl_balance
        FROM finance_ledger_balance
       WHERE gl_code = p_gl_code;

      UPDATE appauth_query_table
         SET chr_column3 = w_gl_name, dec_column4 = w_gl_balance
       WHERE app_user_id = p_app_user_id;
   ELSIF p_branch_code > 0
   THEN
      INSERT INTO appauth_query_table (chr_column1,
                                       dat_column1,
                                       chr_column2,
                                       dec_column1,
                                       dec_column2,
                                       dec_column3,
                                       app_user_id)
           SELECT serial_number,
                  transaction_date,
                  transaction_narration,
                  credit_balance,
                  debit_balance,
                  SUM (credit_balance - debit_balance)
                     OVER (ORDER BY serial_number) ledger_balance,
                  p_app_user_id
             FROM (SELECT 1  serial_number,
                          p_from_date - 1 transaction_date,
                          'Opening Balance' transaction_narration,
                          (CASE
                              WHEN o_gl_balance > 0 THEN o_gl_balance
                              ELSE 0
                           END) credit_balance,
                          (CASE
                              WHEN o_gl_balance < 0 THEN abs (o_gl_balance)
                              ELSE 0
                           END) debit_balance
                     FROM fn_finance_get_ason_glbal (p_branch_code,
                                                     p_gl_code,
                                                     p_from_date - 1)
                   UNION ALL
                   SELECT   (ROW_NUMBER ()
                             OVER (
                                ORDER BY
                                   transaction_date, batch_number, batch_serial))
                          + 1 serial_number,
                          transaction_date,
                          transaction_narration,
                          (CASE
                              WHEN tran_debit_credit = 'C' THEN tran_amount
                              ELSE 0
                           END) credit_balance,
                          (CASE
                              WHEN tran_debit_credit = 'D' THEN tran_amount
                              ELSE 0
                           END) debit_balance
                     FROM finance_transaction_details
                    WHERE     tran_gl_code = p_gl_code
                          AND acbrn_code = p_branch_code
                          AND cancel_by IS NULL
                          AND transaction_date BETWEEN p_from_date
                                                   AND p_upto_date) a
         ORDER BY serial_number;

      SELECT sum (gl_balance)
        INTO w_gl_balance
        FROM finance_ledger_balance
       WHERE branch_code = p_branch_code AND gl_code = p_gl_code;

      UPDATE appauth_query_table
         SET chr_column3 = w_gl_name, dec_column4 = w_gl_balance
       WHERE app_user_id = p_app_user_id;
   END IF;

   o_status := 'S';
   o_errm := '';
EXCEPTION
   WHEN OTHERS
   THEN
      IF w_status = 'E'
      THEN
         o_status := w_status;
         o_errm := w_errm;
      ELSE
         o_errm := SQLERRM;
         o_status := 'E';
      END IF;
END;
$$;


ALTER FUNCTION public.fn_finance_query_ledger_statement(p_gl_code character, p_branch_code integer, p_from_date date, p_upto_date date, p_app_user_id character, OUT o_status character, OUT o_errm character) OWNER TO jameaquasemia;

--
-- Name: fn_finance_run_cash_report(integer, date, date, character); Type: FUNCTION; Schema: public; Owner: jameaquasemia
--

CREATE FUNCTION public.fn_finance_run_cash_report(p_branch_code integer, p_from_date date, p_upto_date date, p_app_user_id character, OUT o_status character, OUT o_errm character) RETURNS record
    LANGUAGE plpgsql
    AS $$
DECLARE
   rec_account_list         RECORD;
   rec_date_list            RECORD;
   w_current_business_day   DATE;
   w_opening_date           DATE;
   w_ason_date              DATE;
   w_from_date              DATE;
   w_upto_date              DATE;
   w_sql_stat               TEXT := '';
   w_cash_gl_code           VARCHAR;
   w_delar_id               INTEGER;
   w_status                 VARCHAR;
   w_errm                   VARCHAR;
   w_closing_balance        NUMERIC (22, 2);
   w_opening_balance        NUMERIC (22, 2);
BEGIN
   SELECT cash_gl_code
     INTO w_cash_gl_code
     FROM appauth_user_settings
    WHERE app_user_id = p_app_user_id;

   IF p_from_date = p_upto_date
   THEN
      w_opening_date := p_from_date - 1;
      w_ason_date := p_from_date;
   ELSE
      w_from_date := p_from_date;
      w_upto_date := p_upto_date;
      w_opening_date := p_from_date - 1;
   END IF;

   w_sql_stat =
         'INSERT INTO appauth_report_table_tabular (report_column1,
                                        report_column2,
                                        report_column3,
                                        report_column4,
                                        report_column5,
                                        report_column6,
                                        report_column7,
                                        report_column8,
                                        report_column9,
                                        report_column10,
                                        app_user_id)
   SELECT ROW_NUMBER () OVER (ORDER BY t.transaction_date, t.contra_gl_code)
             ROW_NUMBER,
       t.transaction_date,
       t.contra_gl_code,
       COALESCE (l.gl_name || '' ['' || l.gl_code || '']'', ''Opening Balance'')
          gl_name,
       t.cash_credit_amount,
       t.cash_debit_amount,
       t.cash_balance,
       t.bank_credit_amount,
       t.bank_debit_amount,
       t.bank_balance,
         '''
      || p_app_user_id
      || '''
  FROM (  SELECT transaction_date,
                 contra_gl_code,
                 sum (cash_credit_amount)
                    cash_credit_amount,
                 sum (cash_debit_amount)
                    cash_debit_amount,
                 sum (sum (cash_credit_amount) - sum (cash_debit_amount))
                    OVER (ORDER BY transaction_date, contra_gl_code)
                    cash_balance,
                 sum (bank_credit_amount)
                    bank_credit_amount,
                 sum (bank_debit_amount)
                    bank_debit_amount,
                 sum (sum (bank_credit_amount) - sum (bank_debit_amount))
                    OVER (ORDER BY transaction_date, contra_gl_code)
                    bank_balance
            FROM (SELECT '''
      || w_opening_date
      || ''' transaction_date,
                         ''00000000'' contra_gl_code,
                         cum_credit_sum cash_credit_amount,
                         cum_debit_sum cash_debit_amount,
                         0.00 bank_credit_amount,
                         0.00 bank_debit_amount
                    FROM (  SELECT b.gl_code,
                                   sum (b.cum_credit_sum) cum_credit_sum,
                                   sum (b.cum_debit_sum) cum_debit_sum
                              FROM finance_ledger_balance_hist b,
                                   (  SELECT branch_code, gl_code,
                                             max (transaction_date) transaction_date
                                        FROM finance_ledger_balance_hist t
                                       WHERE  t.transaction_date <= '''
      || w_opening_date
      || ''' and t.gl_code = '''
      || w_cash_gl_code
      || '''';

   IF p_branch_code <> 0
   THEN
      w_sql_stat := w_sql_stat || ' and branch_code = ' || p_branch_code;
   END IF;

   w_sql_stat :=
         w_sql_stat
      || ' GROUP BY branch_code, gl_code) h,
                                   finance_general_ledger l
                             WHERE     h.gl_code = b.gl_code
                                   AND h.transaction_date = b.transaction_date
                                   and h.branch_code=b.branch_code
                                   AND l.gl_code = b.gl_code
                          GROUP BY b.gl_code) og
                  UNION ALL
                  SELECT transaction_date,
                         contra_gl_code,
                         (CASE
                             WHEN tran_debit_credit = ''C'' THEN tran_amount
                             ELSE 0
                          END) cash_credit_amount,
                         (CASE
                             WHEN tran_debit_credit = ''D'' THEN tran_amount
                             ELSE 0
                          END) cash_debit_amount,
                         0.00 bank_credit_amount,
                         0.00 bank_debit_amount
                    FROM finance_transaction_details t
                   WHERE tran_gl_code = '''
      || w_cash_gl_code
      || ''' AND cancel_by IS NULL ';

   IF p_branch_code <> 0
   THEN
      w_sql_stat := w_sql_stat || ' and t.acbrn_code = ' || p_branch_code;
   END IF;


   IF w_from_date IS NOT NULL AND w_upto_date IS NOT NULL
   THEN
      w_sql_stat :=
            w_sql_stat
         || ' and t.transaction_date between '''
         || w_from_date
         || ''' and '''
         || w_upto_date
         || '''';
   END IF;

   IF w_ason_date IS NOT NULL
   THEN
      w_sql_stat :=
         w_sql_stat || ' and t.transaction_date = ''' || w_ason_date || '''';
   END IF;

   w_sql_stat :=
         w_sql_stat
      || '  UNION ALL
                  SELECT '''
      || w_opening_date
      || ''' transaction_date,
                         ''00000000'' contra_gl_code,
                         0.00 cash_credit_amount,
                         0.00 cash_debit_amount,
                         cum_credit_sum bank_credit_amount,
                         cum_debit_sum bank_debit_amount
                    FROM (  SELECT b.gl_code,
                                   sum (b.cum_credit_sum) cum_credit_sum,
                                   sum (b.cum_debit_sum) cum_debit_sum
                              FROM finance_ledger_balance_hist b,
                                   (  SELECT t.branch_code, gl_code,
                                             max (transaction_date) transaction_date
                                        FROM finance_ledger_balance_hist t,
                                             finance_bank_ledger b
                                       WHERE    t.transaction_date <= '''
      || w_opening_date
      || ''' and t.gl_code = b.ledger_code  AND t.branch_code = b.branch_code ';

   IF p_branch_code <> 0
   THEN
      w_sql_stat := w_sql_stat || ' and t.branch_code = ' || p_branch_code;
   END IF;

   w_sql_stat :=
         w_sql_stat
      || '  GROUP BY t.branch_code, gl_code) h,
                                   finance_general_ledger l
                             WHERE     h.gl_code = b.gl_code
                                   AND h.transaction_date = b.transaction_date
                                   AND l.gl_code = b.gl_code
                                   and h.branch_code=b.branch_code
                          GROUP BY b.gl_code) og
                  UNION ALL
                  SELECT t.transaction_date,
                         t.contra_gl_code,
                         0.00 cash_credit_amount,
                         0.00 cash_debit_amount,
                         (CASE
                             WHEN t.tran_debit_credit = ''C'' THEN t.tran_amount
                             ELSE 0
                          END) bank_credit_amount,
                         (CASE
                             WHEN t.tran_debit_credit = ''D'' THEN t.tran_amount
                             ELSE 0
                          END) bank_debit_amount
                    FROM finance_transaction_details t, finance_bank_ledger b
                   WHERE     t.tran_gl_code = b.ledger_code
                         AND t.acbrn_code = b.branch_code ';

   IF p_branch_code <> 0
   THEN
      w_sql_stat := w_sql_stat || ' and t.acbrn_code = ' || p_branch_code;
   END IF;

   IF w_from_date IS NOT NULL AND w_upto_date IS NOT NULL
   THEN
      w_sql_stat :=
            w_sql_stat
         || ' and t.transaction_date between '''
         || w_from_date
         || ''' and '''
         || w_upto_date
         || '''';
   END IF;

   IF w_ason_date IS NOT NULL
   THEN
      w_sql_stat :=
         w_sql_stat || ' and t.transaction_date = ''' || w_ason_date || '''';
   END IF;

   w_sql_stat := w_sql_stat || '  AND cancel_by IS NULL) d
        GROUP BY transaction_date, contra_gl_code
        ORDER BY transaction_date, contra_gl_code) t
       LEFT OUTER JOIN finance_general_ledger l
          ON (l.gl_code = t.contra_gl_code)';

   --RAISE EXCEPTION USING MESSAGE = w_sql_stat;
   EXECUTE w_sql_stat;

   o_status := 'S';
   o_errm := '';
EXCEPTION
   WHEN OTHERS
   THEN
      IF w_status = 'E'
      THEN
         o_status := w_status;
         o_errm := w_errm;
      ELSE
         o_status := 'E';
         o_errm := SQLERRM;
      END IF;
END;
$$;


ALTER FUNCTION public.fn_finance_run_cash_report(p_branch_code integer, p_from_date date, p_upto_date date, p_app_user_id character, OUT o_status character, OUT o_errm character) OWNER TO jameaquasemia;

--
-- Name: fn_finance_telbal_hist(character, integer); Type: FUNCTION; Schema: public; Owner: jameaquasemia
--

CREATE FUNCTION public.fn_finance_telbal_hist(p_teller_id character, p_branch_code integer, OUT o_status character, OUT o_errm character) RETURNS record
    LANGUAGE plpgsql
    AS $$
DECLARE
   rec_teller_list      RECORD;
   rec_date_list        RECORD;
   w_calculate_date     DATE;
   w_teller_banalce     NUMERIC (22, 2) := 0;
   w_cum_credit_sum     NUMERIC (22, 2) := 0;
   w_cum_debit_sum      NUMERIC (22, 2) := 0;
   w_total_debit_sum    NUMERIC (22, 2) := 0;
   w_total_credit_sum   NUMERIC (22, 2) := 0;
   w_status             VARCHAR;
   w_errm               VARCHAR;
   w_tran_gl_code       VARCHAR;
BEGIN
   BEGIN
      SELECT cash_gl_code
        INTO w_tran_gl_code
        FROM finance_application_settings;
   END;

   FOR rec_teller_list
      IN (SELECT branch_code,
                 teller_id,
                 last_transaction_date,
                 last_balance_update
            FROM finance_transaction_telbal
           WHERE     branch_code = p_branch_code
                 AND teller_id = p_teller_id
                 AND NOT is_balance_updated)
   LOOP
      w_calculate_date := rec_teller_list.last_balance_update;

      SELECT COALESCE (teller_balance, 0.00),
             COALESCE (cum_credit_sum, 0.00),
             COALESCE (cum_debit_sum, 0.00)
        INTO w_teller_banalce, w_cum_credit_sum, w_cum_debit_sum
        FROM finance_tran_telbal_hist h
       WHERE     h.teller_id = rec_teller_list.teller_id
             AND branch_code = rec_teller_list.branch_code
             AND h.transaction_date =
                 (SELECT max (transaction_date)
                   FROM finance_tran_telbal_hist
                  WHERE     teller_id = rec_teller_list.teller_id
                        AND transaction_date <= w_calculate_date - 1);

      w_teller_banalce := COALESCE (w_teller_banalce, 0.00);
      w_cum_credit_sum := COALESCE (w_cum_credit_sum, 0.00);
      w_cum_debit_sum := COALESCE (w_cum_debit_sum, 0.00);

      FOR rec_date_list
         IN (  SELECT transaction_date,
                      COALESCE (SUM (debit_amount), 0.00) total_debit_amount,
                      COALESCE (sum (credit_amount), 0.00) total_credit_amount
                 FROM (  SELECT transaction_date,
                                sum (cash_credit_amount) credit_amount,
                                sum (cash_debit_amount) debit_amount
                           FROM (SELECT transaction_date,
                                        (CASE
                                            WHEN tran_debit_credit = 'D'
                                            THEN
                                               tran_amount
                                            ELSE
                                               0
                                         END) cash_credit_amount,
                                        (CASE
                                            WHEN tran_debit_credit = 'C'
                                            THEN
                                               tran_amount
                                            ELSE
                                               0
                                         END) cash_debit_amount
                                   FROM finance_transaction_details t
                                  WHERE     tran_gl_code = w_tran_gl_code
                                        AND app_user_id = p_teller_id
                                        AND transaction_date >
                                              rec_teller_list.last_balance_update
                                            - 1
                                        AND cancel_by IS NULL) t
                       GROUP BY transaction_date
                       UNION ALL
                         SELECT transaction_date,
                                sum (cash_credit_amount) cash_payment_amount,
                                sum (cash_debit_amount) cash_receive_amount
                           FROM (SELECT org_teller_id,
                                        transaction_date,
                                        (CASE
                                            WHEN tran_debit_credit = 'C'
                                            THEN
                                               tran_amount
                                            ELSE
                                               0
                                         END) cash_credit_amount,
                                        (CASE
                                            WHEN tran_debit_credit = 'D'
                                            THEN
                                               tran_amount
                                            ELSE
                                               0
                                         END) cash_debit_amount
                                   FROM finance_tran_telbal_details t
                                  WHERE     org_teller_id = p_teller_id
                                        AND transaction_date >
                                              rec_teller_list.last_balance_update
                                            - 1
                                        AND auth_by IS NOT NULL) t
                       GROUP BY transaction_date) T
             GROUP BY transaction_date
             ORDER BY transaction_date)
      LOOP
         w_calculate_date := rec_date_list.transaction_date;
         w_total_credit_sum := rec_date_list.total_credit_amount;
         w_total_debit_sum := rec_date_list.total_debit_amount;
         w_cum_credit_sum :=
            w_cum_credit_sum + rec_date_list.total_credit_amount;
         w_cum_debit_sum :=
            w_cum_debit_sum + rec_date_list.total_debit_amount;
         w_teller_banalce :=
            w_teller_banalce + (w_total_credit_sum - w_total_debit_sum);

         DELETE FROM
            finance_tran_telbal_hist
               WHERE     branch_code = rec_teller_list.branch_code
                     AND teller_id = p_teller_id
                     AND transaction_date = w_calculate_date;

         INSERT INTO finance_tran_telbal_hist (branch_code,
                                               transaction_date,
                                               teller_id,
                                               total_debit_sum,
                                               total_credit_sum,
                                               cum_debit_sum,
                                               cum_credit_sum,
                                               teller_balance,
                                               app_user_id,
                                               app_data_time)
              VALUES (rec_teller_list.branch_code,
                      w_calculate_date,
                      p_teller_id,
                      COALESCE (w_total_debit_sum, 0.00),
                      COALESCE (w_total_credit_sum, 0.00),
                      COALESCE (w_cum_credit_sum, 0.00),
                      COALESCE (w_cum_debit_sum, 0.00),
                      COALESCE (w_teller_banalce, 0.00),
                      'SYSTEM',
                      current_timestamp);
      END LOOP;

      UPDATE finance_transaction_telbal
         SET last_balance_update = w_calculate_date,
             is_balance_updated = TRUE
       WHERE     branch_code = rec_teller_list.branch_code
             AND teller_id = p_teller_id;
   END LOOP;

   o_status := 'S';
   o_errm := '';
EXCEPTION
   WHEN OTHERS
   THEN
      IF w_status = 'E'
      THEN
         o_status := w_status;
         o_errm := w_errm;
      ELSE
         o_status := 'E';
         o_errm := SQLERRM;
      END IF;
END;
$$;


ALTER FUNCTION public.fn_finance_telbal_hist(p_teller_id character, p_branch_code integer, OUT o_status character, OUT o_errm character) OWNER TO jameaquasemia;

--
-- Name: fn_get_final_result_gpa(integer, integer, character, character, character); Type: FUNCTION; Schema: public; Owner: jameaquasemia
--

CREATE FUNCTION public.fn_get_final_result_gpa(p_academic_year_id integer, p_term_id integer, p_class_id character, p_student_roll character, p_app_user_id character, OUT o_total_mark numeric, OUT o_total_obtain_mark numeric, OUT result_gpa numeric, OUT grade_name character) RETURNS record
    LANGUAGE plpgsql
    AS $$
DECLARE
   w_total_mark           NUMERIC := 0.00;
   w_total_grade_point    NUMERIC := 0.00;
   w_total_earned_point   NUMERIC := 0.00;
   w_obtain_mark          NUMERIC := 0.00;
   w_out_of               NUMERIC := 0.00;
   w_credit               NUMERIC := 0.00;
   w_total_subjects       NUMERIC := 0;
   w_final_grade_name     CHARACTER VARYING (200);
   w_grade_point_s        NUMERIC := 0;
   w_subjects             RECORD;
   w_subject_mark_info    RECORD;
   w_grades               RECORD;
BEGIN
   --WITH subjects as (SELECT * FROM edu_subject_list sub where class_id=p_class_id)

   SELECT out_of
     INTO w_out_of
     FROM edu_academic_class
    WHERE class_id = p_class_id;

   FOR w_subjects
      IN (SELECT DISTINCT sub.subject_id, sub.out_of, sub.credit
            FROM edu_subject_list sub
                 JOIN edu_exam_single_mark e
                    ON     sub.class_id = p_class_id
                       AND sub.class_id = e.class_id
                       AND sub.subject_id = e.subject_id
                       AND e.term_id = p_term_id)
   LOOP
      SELECT *
        INTO w_subject_mark_info
        FROM fn_get_student_subject_mark (p_academic_year_id,
                                          p_term_id,
                                          p_class_id,
                                          p_student_roll,
                                          w_subjects.subject_id,
                                          w_subjects.out_of,
                                          p_app_user_id);

      IF w_subject_mark_info.o_grade_name = 'F'
      THEN
         w_total_grade_point := 0;
         w_total_earned_point := 0;
         EXIT;
      END IF;

      w_credit := w_credit + w_subjects.credit;
      w_total_earned_point :=
           w_total_earned_point
         + (w_subjects.credit * w_subject_mark_info.o_grade_point);
      w_total_mark := w_total_mark + w_subject_mark_info.o_total_mark;
      w_total_grade_point :=
         w_total_grade_point + w_subject_mark_info.o_grade_point;
      w_obtain_mark :=
         w_obtain_mark + w_subject_mark_info.o_total_obtain_mark;
      w_total_subjects := w_total_subjects + 1;
   END LOOP;

   IF w_out_of = 5 AND w_total_subjects > 0
   THEN
      result_gpa :=
         CAST ((w_total_grade_point / w_total_subjects) AS decimal (10, 2));
   ELSEIF w_out_of = 4 AND w_credit > 0
   THEN
      result_gpa :=
         CAST ((w_total_earned_point / w_credit) AS decimal (10, 2));
   END IF;

   SELECT g.grade_name
     INTO w_final_grade_name
     FROM fn_get_grade_nameBy_point (result_gpa, w_out_of) g;

   --RAISE 'value of a : %', w_grade_name;
   grade_name := w_final_grade_name;
   o_total_mark := w_total_mark;
   o_total_obtain_mark := w_obtain_mark;
END
$$;


ALTER FUNCTION public.fn_get_final_result_gpa(p_academic_year_id integer, p_term_id integer, p_class_id character, p_student_roll character, p_app_user_id character, OUT o_total_mark numeric, OUT o_total_obtain_mark numeric, OUT result_gpa numeric, OUT grade_name character) OWNER TO jameaquasemia;

--
-- Name: fn_get_inventory_number(integer, integer, character, character, integer); Type: FUNCTION; Schema: public; Owner: jameaquasemia
--

CREATE FUNCTION public.fn_get_inventory_number(p_inv_code integer, p_branch_code integer, p_inv_prefix character, p_inv_naration character, p_length integer DEFAULT 1) RETURNS character varying
    LANGUAGE plpgsql
    AS $$
DECLARE
   w_message              VARCHAR;
   w_last_used_number     INTEGER;
   w_return               VARCHAR;
   w_inv_prefix           VARCHAR;
   w_number_with_prefix   VARCHAR;
   w_inv_length           INTEGER;
BEGIN
   BEGIN
      SELECT last_used_number, inv_prefix, inv_length
        INTO w_last_used_number, w_inv_prefix, w_inv_length
        FROM appauth_inventory_number s
       WHERE     s.inv_code = p_inv_code
             AND s.branch_code = p_branch_code
             AND s.inv_prefix = p_inv_prefix;

      IF NOT FOUND
      THEN
         INSERT INTO appauth_inventory_number (inv_code,
                                               branch_code,
                                               app_user_id,
                                               inv_prefix,
                                               last_used_number,
                                               inv_naration,
                                               inv_length)
              VALUES (p_inv_code,
                      p_branch_code,
                      NULL,
                      P_inv_prefix,
                      1,
                      p_inv_naration,
                      p_length);

         w_last_used_number := 1;
         w_inv_prefix := P_inv_prefix;
         w_inv_length := p_length;
      END IF;
   EXCEPTION
      WHEN NO_DATA_FOUND
      THEN
         INSERT INTO appauth_inventory_number (inv_code,
                                               branch_code,
                                               app_user_id,
                                               inv_prefix,
                                               last_used_number,
                                               inv_naration,
                                               inv_length)
              VALUES (p_inv_code,
                      p_branch_code,
                      NULL,
                      P_inv_prefix,
                      0,
                      p_inv_naration,
                      p_length);

         w_last_used_number := 0;
         w_inv_prefix := p_inv_prefix;
         w_inv_length := p_length;
   END;

   -- limit 100 for update;

   UPDATE appauth_inventory_number s
      SET last_used_number = last_used_number + 1
    WHERE s.inv_code = p_inv_code AND s.branch_code = p_branch_code;

   IF w_inv_length > 1
   THEN
      w_number_with_prefix :=
            w_inv_prefix
         || lpad (cast (w_last_used_number AS VARCHAR), w_inv_length, '0');
      w_return := w_number_with_prefix;
   ELSE
      w_return := w_inv_prefix || w_last_used_number;
   END IF;

   RETURN w_return;
END;
$$;


ALTER FUNCTION public.fn_get_inventory_number(p_inv_code integer, p_branch_code integer, p_inv_prefix character, p_inv_naration character, p_length integer) OWNER TO jameaquasemia;

--
-- Name: fn_get_next_installment_date(character, date, date); Type: FUNCTION; Schema: public; Owner: jameaquasemia
--

CREATE FUNCTION public.fn_get_next_installment_date(p_inst_freq character, p_inst_from_date date, p_ason_date date) RETURNS date
    LANGUAGE plpgsql
    AS $$
DECLARE
   W_MESSAGE          CHARACTER (20);
   w_next_inst_date   DATE;
   O_ERRM             CHARACTER (100);
   W_STATUS           CHARACTER (20);
   W_NOI              INTEGER;
   W_NOD              INTEGER;
BEGIN
   IF p_inst_freq = 'W'
   THEN
      W_NOD := FLOOR ((p_ason_date - p_inst_from_date) / 7) * 7 + 7;
      w_next_inst_date := p_inst_from_date + W_NOD;
      W_NOI := W_NOD / 7;
   ELSIF p_inst_freq = 'M'
   THEN
      W_NOI :=
           DATE_PART ('year', AGE (p_ason_date, p_inst_from_date)) * 12
         + DATE_PART ('month', AGE (p_ason_date, p_inst_from_date))
         + 1;
      w_next_inst_date :=
         (p_inst_from_date + (W_NOI || ' months')::INTERVAL)::DATE;
   ELSIF p_inst_freq = 'Q'
   THEN
      W_NOI :=
           DATE_PART ('year', AGE (p_ason_date, p_inst_from_date)) * 4
         + FLOOR (
              DATE_PART ('month', AGE (p_ason_date, p_inst_from_date)) / 3)
         + 1;
      w_next_inst_date :=
         (p_inst_from_date + (3 * W_NOI || ' months')::INTERVAL)::DATE;
   ELSIF p_inst_freq = 'H'
   THEN
      W_NOI :=
           DATE_PART ('year', AGE (p_ason_date, p_inst_from_date)) * 2
         + FLOOR (
              DATE_PART ('month', AGE (p_ason_date, p_inst_from_date)) / 6)
         + 1;
      w_next_inst_date :=
         (p_inst_from_date + (6 * W_NOI || ' months')::INTERVAL)::DATE;
   ELSIF p_inst_freq = 'Y'
   THEN
      W_NOI :=
           DATE_PART ('year', AGE (p_ason_date, p_inst_from_date)) * 1
         + FLOOR (
              DATE_PART ('month', AGE (p_ason_date, p_inst_from_date)) / 12)
         + 1;
      w_next_inst_date :=
         (p_inst_from_date + (12 * W_NOI || ' months')::INTERVAL)::DATE;
   ELSIF p_inst_freq = 'D'
   THEN
      w_next_inst_date := p_ason_date + 1;
      W_NOI := p_inst_from_date - p_ason_date;
   END IF;

   RETURN w_next_inst_date;
EXCEPTION
   WHEN OTHERS
   THEN
      NULL;
END;
$$;


ALTER FUNCTION public.fn_get_next_installment_date(p_inst_freq character, p_inst_from_date date, p_ason_date date) OWNER TO jameaquasemia;

--
-- Name: fn_get_result_gpa(numeric, numeric); Type: FUNCTION; Schema: public; Owner: jameaquasemia
--

CREATE FUNCTION public.fn_get_result_gpa(p_obtain_mark numeric, p_total_mark numeric, OUT result_gpa numeric, OUT grade_name character) RETURNS record
    LANGUAGE plpgsql
    AS $$
DECLARE
   w_obtain_mark_prsent   NUMERIC;
   w_grade_name           CHARACTER VARYING (200);
   w_result_gpa           NUMERIC;
BEGIN
   IF p_obtain_mark <= 0
   THEN
      w_obtain_mark_prsent = 0;
   ELSE
      w_obtain_mark_prsent := round ((p_obtain_mark / p_total_mark) * 100);
   END IF;

   SELECT g.grade_name, g.result_gpa
     INTO w_grade_name, w_result_gpa
     FROM edu_result_grade g
    WHERE w_obtain_mark_prsent BETWEEN g.lowest_mark AND g.highest_mark;

   grade_name := w_grade_name;
   result_gpa := w_result_gpa;
END
$$;


ALTER FUNCTION public.fn_get_result_gpa(p_obtain_mark numeric, p_total_mark numeric, OUT result_gpa numeric, OUT grade_name character) OWNER TO jameaquasemia;

--
-- Name: fn_get_student_subject_mark(integer, integer, character, character, character, numeric, character); Type: FUNCTION; Schema: public; Owner: jameaquasemia
--

CREATE FUNCTION public.fn_get_student_subject_mark(p_academic_year_id integer, p_term_id integer, p_class_id character, p_student_roll character, p_subject_id character, p_out_of numeric, p_app_user_id character, OUT o_grade_name character, OUT o_grade_point numeric, OUT o_total_mark numeric, OUT o_total_obtain_mark numeric, OUT o_status character, OUT o_errm character) RETURNS record
    LANGUAGE plpgsql
    AS $$
DECLARE
   w_student_mark   RECORD;
BEGIN
   WITH
      exams
      AS
         (SELECT *
           FROM edu_exam_single_mark
          WHERE     academic_year = p_academic_year_id
                AND term_id = p_term_id
                AND class_id = p_class_id
                AND subject_id = p_subject_id
                AND student_roll = p_student_roll),
      student_marks
      AS
         (  SELECT student_roll,
                   sum (total_exam_marks) AS total_marks,
                   sum (obtain_marks) AS total_obtain_marks
              FROM exams
          GROUP BY student_roll)
   SELECT DISTINCT
          (e.student_roll),
          e.academic_year,
          e.class_id,
          e.subject_id,
          m.total_marks,
          m.total_obtain_marks,
          (SELECT result_gpa
           FROM fn_get_result_gpa (m.total_obtain_marks,
                                   m.total_marks,
                                   p_out_of)) result_gpa,
          (SELECT grade_name
           FROM fn_get_result_gpa (m.total_obtain_marks,
                                   m.total_marks,
                                   p_out_of)) grade_name
     INTO w_student_mark
     FROM student_marks m
          LEFT JOIN exams e ON e.student_roll = m.student_roll;

   o_grade_name := w_student_mark.grade_name;
   o_grade_point := w_student_mark.result_gpa;
   o_total_mark := w_student_mark.total_marks;
   o_total_obtain_mark := w_student_mark.total_obtain_marks;
EXCEPTION
   WHEN OTHERS
   THEN
      o_errm := SQLERRM;
      o_status := 'E';
END;
$$;


ALTER FUNCTION public.fn_get_student_subject_mark(p_academic_year_id integer, p_term_id integer, p_class_id character, p_student_roll character, p_subject_id character, p_out_of numeric, p_app_user_id character, OUT o_grade_name character, OUT o_grade_point numeric, OUT o_total_mark numeric, OUT o_total_obtain_mark numeric, OUT o_status character, OUT o_errm character) OWNER TO jameaquasemia;

--
-- Name: fn_onlineexam_live(integer, character, character, character); Type: FUNCTION; Schema: public; Owner: jameaquasemia
--

CREATE FUNCTION public.fn_onlineexam_live(p_branch_code integer, p_student_roll character, p_online_exam_id character, p_app_user_id character, OUT o_status character, OUT o_errm character) RETURNS record
    LANGUAGE plpgsql
    AS $$
DECLARE
   r_online_exam           RECORD;
   w_ans_info_id           CHARACTER VARYING (20);
   w_answer_id             CHARACTER VARYING (20);
   w_online_exam_ques      RECORD;
   w_online_exam_que_dtl   RECORD;
   w_obtain_mark           NUMERIC;
   w_total_mark            NUMERIC;
   w_exam                  RECORD;
BEGIN
   BEGIN
      SELECT *
        INTO w_ans_info_id
        FROM fn_get_inventory_number (20000,
                                      p_branch_code,
                                      'ANS',
                                      'Answer ID Generate',
                                      6);

      SELECT *
        INTO r_online_exam
        FROM edu_online_exam_information i
       WHERE i.online_exam_id = p_online_exam_id;

      INSERT INTO edu_onlineexam_ans_info (ans_info_id,
                                           exam_date,
                                           exam_start_time,
                                           exam_end_time,
                                           publish_status,
                                           total_obtain_marks,
                                           total_marks,
                                           app_user_id,
                                           app_data_time,
                                           online_exam_id,
                                           student_roll)
           VALUES (w_ans_info_id,
                   r_online_exam.exam_date,
                   r_online_exam.exam_start_time,
                   r_online_exam.exam_end_time,
                   'Live',
                   0,
                   r_online_exam.total_marks,
                   p_app_user_id,
                   current_timestamp,
                   r_online_exam.online_exam_id,
                   p_student_roll);

      FOR w_online_exam_ques IN (SELECT *
                                   FROM edu_online_exam_questions q
                                  WHERE q.online_exam_id = p_online_exam_id)
      LOOP
         SELECT *
           INTO w_answer_id
           FROM fn_get_inventory_number (30000,
                                         p_branch_code,
                                         'QS',
                                         'Question Answer ID Generate',
                                         6);

         INSERT INTO edu_onlineexam_question_ans (answer_id,
                                                  ans_info_id,
                                                  student_roll,
                                                  question_id,
                                                  obtain_marks,
                                                  question_marks,
                                                  app_user_id,
                                                  app_data_time)
              VALUES (w_answer_id,
                      w_ans_info_id,
                      p_student_roll,
                      w_online_exam_ques.question_id,
                      0,
                      w_online_exam_ques.question_marks,
                      p_app_user_id,
                      current_timestamp);

         FOR w_online_exam_que_dtl
            IN (SELECT *
                  FROM edu_online_exam_qstn_dtl d
                 WHERE d.question_id = w_online_exam_ques.question_id)
         LOOP
            INSERT INTO edu_onlineexam_qstn_ansdtl (question_details_id,
                                                    answer_id,
                                                    answer_option,
                                                    is_correct_answer,
                                                    app_user_id,
                                                    app_data_time)
                 VALUES (w_online_exam_que_dtl.question_details_id,
                         w_answer_id,
                         w_online_exam_que_dtl.question_option,
                         0,
                         p_app_user_id,
                         current_timestamp);
         END LOOP;
      END LOOP;
   END;
EXCEPTION
   WHEN OTHERS
   THEN
      o_errm := SQLERRM;
      o_status := 'E';
END;
$$;


ALTER FUNCTION public.fn_onlineexam_live(p_branch_code integer, p_student_roll character, p_online_exam_id character, p_app_user_id character, OUT o_status character, OUT o_errm character) OWNER TO jameaquasemia;

--
-- Name: fn_run_edu_fees_report(character, character); Type: FUNCTION; Schema: public; Owner: jameaquasemia
--

CREATE FUNCTION public.fn_run_edu_fees_report(p_app_user_id character, p_report_name character, OUT o_status character, OUT o_errm character) RETURNS record
    LANGUAGE plpgsql
    AS $$
DECLARE
   rec_account_list         RECORD;
   rec_date_list            RECORD;
   w_current_business_day   DATE;
   w_opening_date           DATE;
   w_ason_date              DATE;
   w_from_date              DATE;
   w_upto_date              DATE;
   w_sql_stat               TEXT := '';
   w_account_type           VARCHAR;
   w_zero_balance           VARCHAR;
   w_delar_id               INTEGER;
   w_status                 VARCHAR;
   w_errm                   VARCHAR;
   w_closing_balance        NUMERIC (22, 2);
   w_opening_balance        NUMERIC (22, 2);
   w_branch_code            INTEGER;
   w_gl_name                VARCHAR;
   w_cash_gl_code           VARCHAR;
   w_account_number         VARCHAR;
   w_employee_id            VARCHAR;
   w_class_id               VARCHAR;
   w_section_id             VARCHAR;
   w_class_group_id         VARCHAR;
   w_fees_head_code         VARCHAR;
   rec_branch_list          RECORD;
   w_teller_id              NUMERIC (22, 2);
BEGIN
   SELECT CASE
             WHEN parameter_values != ''
             THEN
                cast (parameter_values AS INTEGER)
          END w_branch_code
     INTO w_branch_code
     FROM appauth_report_parameter
    WHERE     parameter_name = 'p_branch_code'
          AND report_name = p_report_name
          AND app_user_id = p_app_user_id;

   SELECT CASE
             WHEN parameter_values != '' THEN cast (parameter_values AS DATE)
          END p_from_date
     INTO w_from_date
     FROM appauth_report_parameter
    WHERE     parameter_name = 'p_from_date'
          AND report_name = p_report_name
          AND app_user_id = p_app_user_id;

   SELECT CASE
             WHEN parameter_values != '' THEN cast (parameter_values AS DATE)
          END p_upto_date
     INTO w_upto_date
     FROM appauth_report_parameter
    WHERE     parameter_name = 'p_upto_date'
          AND report_name = p_report_name
          AND app_user_id = p_app_user_id;

   SELECT CASE
             WHEN parameter_values != '' THEN cast (parameter_values AS DATE)
          END p_ason_date
     INTO w_ason_date
     FROM appauth_report_parameter
    WHERE     parameter_name = 'p_ason_date'
          AND report_name = p_report_name
          AND app_user_id = p_app_user_id;

   IF w_from_date = w_upto_date AND w_ason_date IS NULL
   THEN
      w_ason_date := w_upto_date;
   END IF;

   IF p_report_name = 'edu_report_studentfeescollection'
   THEN
      SELECT CASE WHEN parameter_values != '' THEN parameter_values END
       INTO w_class_id
       FROM appauth_report_parameter
      WHERE     parameter_name = 'p_class_id'
            AND report_name = p_report_name
            AND app_user_id = p_app_user_id;

      SELECT CASE WHEN parameter_values != '' THEN parameter_values END
       INTO w_section_id
       FROM appauth_report_parameter
      WHERE     parameter_name = 'p_section_id'
            AND report_name = p_report_name
            AND app_user_id = p_app_user_id;

      SELECT CASE WHEN parameter_values != '' THEN parameter_values END
       INTO w_class_group_id
       FROM appauth_report_parameter
      WHERE     parameter_name = 'p_class_group_id'
            AND report_name = p_report_name
            AND app_user_id = p_app_user_id;

      SELECT CASE WHEN parameter_values != '' THEN parameter_values END
       INTO w_fees_head_code
       FROM appauth_report_parameter
      WHERE     parameter_name = 'p_fees_head_code'
            AND report_name = p_report_name
            AND app_user_id = p_app_user_id;

      w_sql_stat :=
         'INSERT INTO appauth_report_table_tabular (report_column1,
                                          report_column2,
                                          report_column3,
                                          report_column4,
                                          report_column5,
                                          report_column6,
                                          report_column7,
                                          report_column8,
                                          report_column9,
                                          report_column10,
                                          report_column11,
                                          report_column12,
                                          report_column13,
                                          report_column14,
                                          report_column15,
                                          report_column16,
                                          app_user_id)
     SELECT r.student_roll,
            s.student_name,
            h.head_name,
            r.receive_date,
            r.total_due,
            r.total_paid,
            r.total_waive,
            r.total_overdue,
            r.fine_paid,
            r.fees_due,
            r.fees_overdue,
            r.fees_paid,
            r.fees_waive,
            r.fine_due,
            r.fine_overdue,
            r.fine_waive,
       ''' || p_app_user_id || ''' 
       FROM edu_fees_receive_student r,
            edu_fees_head_settings h,
            edu_students_info s
      WHERE h.head_code = r.head_code 
      AND r.student_roll = s.student_roll ';

      IF w_branch_code IS NOT NULL
      THEN
         w_sql_stat :=
            w_sql_stat || ' and s.branch_code = ' || w_branch_code || '';
      END IF;

      IF w_from_date IS NOT NULL AND w_upto_date IS NOT NULL
      THEN
         w_sql_stat :=
               w_sql_stat
            || ' and r.receive_date between '''
            || w_from_date
            || ''' and '''
            || w_upto_date
            || '''';
      END IF;

      IF w_ason_date IS NOT NULL
      THEN
         w_sql_stat :=
            w_sql_stat || ' and r.receive_date = ''' || w_ason_date || '''';
      END IF;

      IF w_class_id IS NOT NULL
      THEN
         w_sql_stat :=
            w_sql_stat || ' and s.class_id = ''' || w_class_id || '''';
      END IF;

      IF w_section_id IS NOT NULL
      THEN
         w_sql_stat :=
            w_sql_stat || ' and s.section_id = ''' || w_section_id || '''';
      END IF;

      IF w_class_group_id IS NOT NULL
      THEN
         w_sql_stat :=
               w_sql_stat
            || ' and s.class_group_id = '''
            || w_class_group_id
            || '''';
      END IF;

      IF w_fees_head_code IS NOT NULL
      THEN
         w_sql_stat :=
            w_sql_stat || ' and r.head_code = ''' || w_fees_head_code || '''';
      END IF;

      w_sql_stat :=
         w_sql_stat || 'ORDER BY s.class_id, s.section_id, s.student_name ';

      --RAISE EXCEPTION USING MESSAGE = w_sql_stat;

      EXECUTE w_sql_stat;
   ELSIF p_report_name = 'finance_teller_balance_report'
   THEN
      SELECT CASE WHEN parameter_values != '' THEN parameter_values END
       INTO w_teller_id
       FROM appauth_report_parameter
      WHERE     parameter_name = 'p_teller_id'
            AND report_name = p_report_name
            AND app_user_id = p_app_user_id;


      FOR rec_branch_list
         IN (SELECT branch_code, teller_id FROM finance_transaction_telbal)
      LOOP
         SELECT *
         INTO w_status, w_errm
         FROM fn_finance_telbal_hist (rec_branch_list.teller_id,
                                      rec_branch_list.branch_code);
      END LOOP;

      w_sql_stat :=
         'INSERT INTO appauth_report_table_tabular (report_column1,
                                          report_column2,
                                          report_column3,
                                          report_column4,
                                          report_column5,
                                          report_column6,
                                          app_user_id)
   WITH
      opening_balance
      AS
         (SELECT h.teller_id,
                 COALESCE (teller_balance, 0.00) teller_balance,
                 COALESCE (cum_credit_sum, 0.00) cum_credit_sum,
                 COALESCE (cum_debit_sum, 0.00) cum_debit_sum
            FROM finance_tran_telbal_hist h
           WHERE     branch_code = ' || w_branch_code || ' ';

      IF w_teller_id IS NOT NULL
      THEN
         w_sql_stat :=
            w_sql_stat || ' AND h.teller_id =  ''' || w_teller_id || '''';
      END IF;

      w_sql_stat := w_sql_stat || ' AND h.transaction_date =
                     (SELECT max (transaction_date)
                       FROM finance_tran_telbal_hist
                      WHERE     branch_code = ' || w_branch_code || ' ';

      IF w_teller_id IS NOT NULL
      THEN
         w_sql_stat :=
            w_sql_stat || ' AND h.teller_id =  ''' || w_teller_id || '''';
      END IF;

      w_sql_stat :=
            w_sql_stat
         || ' AND transaction_date < '''
         || w_from_date
         || ''')),
      periodic_balance
      AS
         (  SELECT b.teller_id,
                   sum (b.total_debit_sum) this_period_debit_sum,
                   sum (b.total_credit_sum) this_period_credit_sum
              FROM finance_tran_telbal_hist b
             WHERE     b.branch_code = '
         || w_branch_code
         || '';

      IF w_teller_id IS NOT NULL
      THEN
         w_sql_stat :=
            w_sql_stat || ' AND h.teller_id =  ''' || w_teller_id || '''';
      END IF;

      w_sql_stat :=
            w_sql_stat
         || ' 
                   AND b.transaction_date BETWEEN '''
         || w_from_date
         || ''' 
                                              AND '''
         || w_upto_date
         || ''' 
          GROUP BY b.teller_id),
      teller_balance
      AS
         (SELECT COALESCE (o.teller_id, p.teller_id) teller_id,
                 teller_balance opening_balance,
                 COALESCE (this_period_debit_sum, 0.00) this_period_debit_sum,
                 COALESCE (this_period_credit_sum, 0.00) this_period_credit_sum,
                   teller_balance
                 - (COALESCE (this_period_credit_sum, 0.00) - COALESCE (this_period_debit_sum, 0.00)) closing_balance
            FROM opening_balance o
                 FULL OUTER JOIN periodic_balance p
                    ON (o.teller_id = p.teller_id))
   SELECT teller_id,
          employee_name,
          opening_balance,
          this_period_debit_sum,
          this_period_credit_sum,
          closing_balance,
          '''
         || p_app_user_id
         || ''' 
     FROM teller_balance b, appauth_user_settings a
    WHERE b.teller_id = a.app_user_id';

      -- RAISE EXCEPTION USING MESSAGE = w_sql_stat;
      EXECUTE w_sql_stat;
   ELSIF p_report_name IN
            ('finance_cash_transaction_details', 'finance_ledger_statements')
   THEN
      BEGIN
         -- RAISE EXCEPTION USING MESSAGE = p_report_name;

         IF p_report_name = 'finance_cash_transaction_details'
         THEN
            SELECT cash_gl_code
              INTO w_cash_gl_code
              FROM appauth_user_settings
             WHERE app_user_id = p_app_user_id;
         ELSE
            SELECT CASE WHEN parameter_values != '' THEN parameter_values END p_gl_code
              INTO w_cash_gl_code
              FROM appauth_report_parameter
             WHERE     parameter_name = 'p_gl_code'
                   AND report_name = p_report_name
                   AND app_user_id = p_app_user_id;

            SELECT gl_name
              INTO w_gl_name
              FROM finance_general_ledger
             WHERE gl_code = w_cash_gl_code;

            INSERT INTO appauth_report_parameter (parameter_name,
                                                  report_name,
                                                  app_user_id,
                                                  parameter_values)
                 VALUES ('p_gl_name',
                         p_report_name,
                         p_app_user_id,
                         w_gl_name);
         END IF;

         FOR rec_branch_list
            IN (SELECT DISTINCT branch_code
                  FROM finance_ledger_balance
                 WHERE     last_transaction_date <> last_balance_update
                       AND gl_code = w_cash_gl_code
                       AND branch_code = w_branch_code)
         LOOP
            SELECT *
            INTO w_status, w_status
            FROM fn_finance_glbal_hist (w_cash_gl_code,
                                        rec_branch_list.branch_code,
                                        w_ason_date);
         END LOOP;

         BEGIN
            SELECT o_gl_balance
            INTO w_opening_balance
            FROM fn_finance_get_ason_glbal (COALESCE (w_branch_code, 0),
                                            w_cash_gl_code,
                                            w_ason_date - 1);
         END;

         BEGIN
            SELECT o_gl_balance
            INTO w_closing_balance
            FROM fn_finance_get_ason_glbal (COALESCE (w_branch_code, 0),
                                            w_cash_gl_code,
                                            w_ason_date);
         END;

         INSERT INTO appauth_report_parameter (parameter_name,
                                               report_name,
                                               app_user_id,
                                               parameter_values)
              VALUES ('p_closing_balance',
                      p_report_name,
                      p_app_user_id,
                      w_closing_balance);

         INSERT INTO appauth_report_parameter (parameter_name,
                                               report_name,
                                               app_user_id,
                                               parameter_values)
              VALUES ('p_opening_balance',
                      p_report_name,
                      p_app_user_id,
                      w_opening_balance);
      END;

      SELECT *
        INTO w_status, w_errm
        FROM fn_finance_query_ledger_statement (w_cash_gl_code,
                                                COALESCE (w_branch_code, 0),
                                                w_from_date,
                                                w_upto_date,
                                                p_app_user_id);

      IF w_status = 'E'
      THEN
         RAISE EXCEPTION USING MESSAGE = w_errm;
      END IF;
   END IF;

   o_status := 'S';
   o_errm := '';
EXCEPTION
   WHEN OTHERS
   THEN
      IF w_status = 'E'
      THEN
         o_status := w_status;
         o_errm := w_errm;
      ELSE
         o_status := 'E';
         o_errm := SQLERRM;
      END IF;
END;
$$;


ALTER FUNCTION public.fn_run_edu_fees_report(p_app_user_id character, p_report_name character, OUT o_status character, OUT o_errm character) OWNER TO jameaquasemia;

--
-- Name: fn_run_report(character, character); Type: FUNCTION; Schema: public; Owner: jameaquasemia
--

CREATE FUNCTION public.fn_run_report(p_app_user_id character, p_report_name character, OUT o_status character, OUT o_errm character) RETURNS record
    LANGUAGE plpgsql
    AS $$
DECLARE
   w_status                 VARCHAR;
   w_errm                   VARCHAR;
   w_sql_stat               TEXT := '';
   w_from_date              DATE;
   w_upto_date              DATE;
   w_ason_date              DATE;
   w_current_business_day   DATE;
   w_ledger_code            VARCHAR;
   w_invoice_number         VARCHAR;
   w_user_id                VARCHAR;
   w_acc_type_code          VARCHAR;
   w_employee_id            VARCHAR;
   w_client_id              VARCHAR;
   w_supplier_id            VARCHAR;
   w_account_number         VARCHAR;
   w_account_title          VARCHAR;
   w_product_id             VARCHAR;
   w_branch_code            INTEGER;
   w_zero_balance           VARCHAR := 'N';
   w_transfer_tran          VARCHAR := 'N';
   w_delar_id               INTEGER;
   w_closing_balance        NUMERIC (22, 2);
   w_opening_balance        NUMERIC (22, 2);
   w_cash_gl_code           VARCHAR;
   rec_delar_list           RECORD;
   rec_branch_list          RECORD;
   rec_product_list         RECORD;
   w_branch_name            VARCHAR;
   w_branch_address         VARCHAR;
   w_empty_sheet            VARCHAR;
   w_center_name            VARCHAR;
   w_center_address         VARCHAR;
BEGIN
   DELETE FROM appauth_report_table_tabular
         WHERE app_user_id = p_app_user_id;

   SELECT CASE WHEN parameter_values != '' THEN parameter_values END w_user_id
     INTO w_user_id
     FROM appauth_report_parameter
    WHERE     parameter_name = 'p_user_id'
          AND report_name = p_report_name
          AND app_user_id = p_app_user_id;

   SELECT CASE
             WHEN parameter_values != ''
             THEN
                cast (parameter_values AS INTEGER)
          END w_branch_code
     INTO w_branch_code
     FROM appauth_report_parameter
    WHERE     parameter_name = 'p_branch_code'
          AND report_name = p_report_name
          AND app_user_id = p_app_user_id;

   IF w_branch_code IS NOT NULL
   THEN
      SELECT branch_name, branch_address
        INTO w_branch_name, w_branch_address
        FROM appauth_branch
       WHERE branch_code = w_branch_code;

      BEGIN
         INSERT INTO appauth_report_parameter (app_user_id,
                                               report_name,
                                               parameter_name,
                                               parameter_values)
              VALUES (p_app_user_id,
                      p_report_name,
                      'p_branch_name',
                      w_branch_name);

         INSERT INTO appauth_report_parameter (app_user_id,
                                               report_name,
                                               parameter_name,
                                               parameter_values)
              VALUES (p_app_user_id,
                      p_report_name,
                      'p_branch_address',
                      w_branch_address);
      END;
   END IF;

   SELECT CASE
             WHEN parameter_values != '' THEN cast (parameter_values AS DATE)
          END p_from_date
     INTO w_from_date
     FROM appauth_report_parameter
    WHERE     parameter_name = 'p_from_date'
          AND report_name = p_report_name
          AND app_user_id = p_app_user_id;

   SELECT CASE
             WHEN parameter_values != '' THEN cast (parameter_values AS DATE)
          END p_upto_date
     INTO w_upto_date
     FROM appauth_report_parameter
    WHERE     parameter_name = 'p_upto_date'
          AND report_name = p_report_name
          AND app_user_id = p_app_user_id;

   SELECT CASE
             WHEN parameter_values != '' THEN cast (parameter_values AS DATE)
          END p_ason_date
     INTO w_ason_date
     FROM appauth_report_parameter
    WHERE     parameter_name = 'p_ason_date'
          AND report_name = p_report_name
          AND app_user_id = p_app_user_id;

   IF w_from_date = w_upto_date AND w_ason_date IS NULL
   THEN
      w_ason_date := w_upto_date;
   END IF;

   IF p_report_name IN ('edu_report_studentfeescollection')
   THEN
      SELECT *
        INTO w_status, w_errm
        FROM fn_run_edu_fees_report (p_app_user_id, p_report_name);

      IF w_status = 'E'
      THEN
         RAISE EXCEPTION USING MESSAGE = w_errm;
      END IF;
   END IF;

   o_status := 'S';
   o_errm := '';
EXCEPTION
   WHEN OTHERS
   THEN
      o_errm := SQLERRM;
      o_status := 'E';
END;
$$;


ALTER FUNCTION public.fn_run_report(p_app_user_id character, p_report_name character, OUT o_status character, OUT o_errm character) OWNER TO jameaquasemia;

--
-- Name: fn_set_final_exam_mark(integer, integer, character, character, character); Type: FUNCTION; Schema: public; Owner: jameaquasemia
--

CREATE FUNCTION public.fn_set_final_exam_mark(p_academic_year_id integer, p_term_id integer, p_class_id character, p_student_roll character, p_app_user_id character, OUT o_gpa numeric, OUT o_grate character) RETURNS record
    LANGUAGE plpgsql
    AS $$
DECLARE
   w_class_id      VARCHAR;
   w_gpa           RECORD;
   w_obtain_mark   NUMERIC;
   w_total_mark    NUMERIC;
BEGIN
   SELECT sum (obtain_marks), sum (total_exam_marks)
     INTO w_obtain_mark, w_total_mark
     FROM edu_exam_marks_by_subject e
    WHERE     e.academic_year = p_academic_year_id
          AND e.term_id = p_term_id
          AND e.class_id = p_class_id
          AND e.student_roll = p_student_roll;


   SELECT *
     INTO w_gpa
     FROM fn_get_final_result_gpa (p_academic_year_id,
                                   p_term_id,
                                   p_class_id,
                                   p_student_roll,
                                   p_app_user_id);

   INSERT INTO edu_exam_marks_final (academic_year,
                                     term_id,
                                     class_id,
                                     class_group_id,
                                     student_roll,
                                     total_exam_marks,
                                     obtain_marks,
                                     result_grade,
                                     grade_point_average,
                                     app_user_id,
                                     app_data_time)
        VALUES (p_academic_year_id,
                p_term_id,
                p_class_id,
                (SELECT class_group_id
                   FROM edu_students_info
                  WHERE student_roll = p_student_roll),
                p_student_roll,
                w_total_mark,
                w_obtain_mark,
                w_gpa.grade_name,
                w_gpa.result_gpa,
                p_app_user_id,
                current_timestamp);

   o_gpa := w_gpa.result_gpa;
   o_grate := w_gpa.grade_name;
END;
$$;


ALTER FUNCTION public.fn_set_final_exam_mark(p_academic_year_id integer, p_term_id integer, p_class_id character, p_student_roll character, p_app_user_id character, OUT o_gpa numeric, OUT o_grate character) OWNER TO jameaquasemia;

--
-- Name: fn_set_single_exam_mark(integer, character, character, character, character, character, numeric, character); Type: FUNCTION; Schema: public; Owner: jameaquasemia
--

CREATE FUNCTION public.fn_set_single_exam_mark(p_academic_year_id integer, p_class_id character, p_class_group_id character, p_student_roll character, p_subject_id character, p_exam_id character, p_out_of numeric, p_app_user_id character, OUT o_total_mark numeric, OUT o_obtain_mark numeric, OUT o_result_gpa numeric, OUT o_grade_name character, OUT o_status character, OUT o_errm character) RETURNS record
    LANGUAGE plpgsql
    AS $$
DECLARE
   w_class_id      VARCHAR;
   r_gpa           RECORD;
   w_obtain_mark   NUMERIC;
   w_total_mark    NUMERIC;
   w_exam          RECORD;
BEGIN
   BEGIN
      SELECT *
        INTO w_exam
        FROM edu_exam_setup E
       WHERE E.exam_id = p_exam_id;

      IF w_exam.cal_condition = 'Avg'
      THEN
         SELECT sum (obtain_marks)
          INTO w_obtain_mark
          FROM edu_exam_marks_details r
         WHERE     r.academic_year = p_academic_year_id
               AND r.class_id = p_class_id
               AND r.subject_id = p_subject_id
               AND r.exam_id = w_exam.exam_id
               AND r.student_roll = p_student_roll;

         w_obtain_mark := w_obtain_mark / w_exam.no_of_exam;
      ELSIF w_exam.cal_condition = 'Max'
      THEN
         SELECT max (obtain_marks)
          INTO w_obtain_mark
          FROM edu_exam_marks_details r
         WHERE     r.academic_year = p_academic_year_id
               AND r.class_id = p_class_id
               AND r.subject_id = p_subject_id
               AND r.exam_id = w_exam.exam_id
               AND r.student_roll = p_student_roll;
      ELSIF w_exam.cal_condition = 'Min'
      THEN
         SELECT min (obtain_marks)
          INTO w_obtain_mark
          FROM edu_exam_marks_details r
         WHERE     r.academic_year = p_academic_year_id
               AND r.class_id = p_class_id
               AND r.subject_id = p_subject_id
               AND r.exam_id = w_exam.exam_id
               AND r.student_roll = p_student_roll;
      ELSE
         SELECT sum (obtain_marks)
          INTO w_obtain_mark
          FROM edu_exam_marks_details r
         WHERE     r.academic_year = p_academic_year_id
               AND r.class_id = p_class_id
               AND r.subject_id = p_subject_id
               AND r.exam_id = w_exam.exam_id
               AND r.student_roll = p_student_roll;
      END IF;

      w_total_mark := w_exam.total_exam_marks;

      SELECT *
        INTO r_gpa
        FROM fn_get_result_gpa (w_obtain_mark, w_total_mark, p_out_of);

      SELECT class_id
       INTO STRICT w_class_id
       FROM edu_exam_single_mark e
      WHERE     e.academic_year = p_academic_year_id
            AND e.class_id = p_class_id
            AND e.subject_id = p_subject_id
            AND e.student_roll = p_student_roll
            AND e.exam_id = p_exam_id;

      UPDATE edu_exam_single_mark m
         SET total_exam_marks = w_total_mark,
             obtain_marks = w_obtain_mark,
             result_grade = r_gpa.grade_name,
             grade_point_average = r_gpa.result_gpa
       WHERE     m.academic_year = p_academic_year_id
             AND m.class_id = p_class_id
             AND m.subject_id = p_subject_id
             AND m.student_roll = p_student_roll
             AND m.exam_id = p_exam_id;
   EXCEPTION
      WHEN NO_DATA_FOUND
      THEN
         INSERT INTO edu_exam_single_mark (academic_year,
                                           term_id,
                                           class_id,
                                           class_group_id,
                                           exam_id,
                                           subject_id,
                                           student_roll,
                                           total_exam_marks,
                                           obtain_marks,
                                           result_grade,
                                           grade_point_average,
                                           app_user_id,
                                           app_data_time)
              VALUES (p_academic_year_id,
                      w_exam.term_id,
                      p_class_id,
                      p_class_group_id,
                      p_exam_id,
                      p_subject_id,
                      p_student_roll,
                      w_total_mark,
                      w_obtain_mark,
                      r_gpa.grade_name,
                      r_gpa.result_gpa,
                      p_app_user_id,
                      current_timestamp);
   END;

   o_total_mark := w_total_mark;
   o_obtain_mark := w_obtain_mark;
   o_grade_name := r_gpa.grade_name;
   o_result_gpa := r_gpa.result_gpa;
   o_status := 'S';
   o_errm := '';
EXCEPTION
   WHEN OTHERS
   THEN
      o_errm := SQLERRM;
      o_status := 'E';
END;
$$;


ALTER FUNCTION public.fn_set_single_exam_mark(p_academic_year_id integer, p_class_id character, p_class_group_id character, p_student_roll character, p_subject_id character, p_exam_id character, p_out_of numeric, p_app_user_id character, OUT o_total_mark numeric, OUT o_obtain_mark numeric, OUT o_result_gpa numeric, OUT o_grade_name character, OUT o_status character, OUT o_errm character) OWNER TO jameaquasemia;

--
-- Name: fn_set_subject_mark_by_student(integer, integer, character, character, character, character, character); Type: FUNCTION; Schema: public; Owner: jameaquasemia
--

CREATE FUNCTION public.fn_set_subject_mark_by_student(p_academic_year_id integer, p_term_id integer, p_class_id character, p_class_group_id character, p_student_roll character, p_subject_id character, p_app_user_id character, OUT o_gpa numeric, OUT o_grate character, OUT o_status character, OUT o_errm character) RETURNS record
    LANGUAGE plpgsql
    AS $$
DECLARE
   w_total_subject_op_mark   NUMERIC := 0;
   w_subject_total_mark      NUMERIC;
   r_exams                   RECORD;
   out_of                    NUMERIC;
   W_total_exam_mark         NUMERIC;
   w_temp                    RECORD;
   w_gpa                     RECORD;
   w_exam_id                 CHARACTER VARYING (200);
   w_grade_name              CHARACTER VARYING (200);
   w_result_gpa              NUMERIC := 0;
   w_single_result           RECORD;
BEGIN
   SELECT maximum_marks
     INTO w_subject_total_mark
     FROM edu_subject_list e
    WHERE e.class_id = p_class_id AND e.subject_id = p_subject_id;

   FOR r_exams
      IN (SELECT *
           FROM edu_exam_setup E
          WHERE     E.academic_year = p_academic_year_id
                AND E.class_id = p_class_id
                AND E.subject_id = p_subject_id)
   LOOP
      w_exam_id := r_exams.exam_id;
      out_of := r_exams.out_of;

      SELECT *
        INTO w_single_result
        FROM fn_set_single_exam_mark (p_academic_year_id,
                                      p_class_id,
                                      p_class_group_id,
                                      p_student_roll,
                                      p_subject_id,
                                      w_exam_id,
                                      out_of,
                                      p_app_user_id);
   --    IF w_status <> 'S'
   --    THEN
   --    RAISE EXCEPTION
   --    USING MESSAGE =
   --    'Error in single result calculation for student '
   --    || p_student_roll
   --    || ' Exam '
   --    || w_exam_id
   --    || w_error;
   --    END IF;

   END LOOP;

   SELECT sum (obtain_marks)
    INTO w_total_subject_op_mark
    FROM edu_exam_single_mark s
   WHERE     s.academic_year = p_academic_year_id
         AND s.class_id = p_class_id
         AND s.student_roll = p_student_roll
         AND s.subject_id = p_subject_id;

   IF w_total_subject_op_mark IS NOT NULL
   THEN
      SELECT result_gpa, grade_name
        INTO w_result_gpa, w_grade_name
        FROM fn_get_result_gpa (w_total_subject_op_mark,
                                w_subject_total_mark,
                                out_of);


      DELETE FROM
         edu_exam_marks_by_subject
            WHERE     academic_year = p_academic_year_id
                  AND class_id = p_class_id
                  AND subject_id = p_subject_id
                  AND student_roll = p_student_roll;

      INSERT INTO edu_exam_marks_by_subject (academic_year,
                                             term_id,
                                             class_id,
                                             class_group_id,
                                             subject_id,
                                             student_roll,
                                             total_exam_marks,
                                             obtain_marks,
                                             result_grade,
                                             grade_point_average,
                                             app_user_id,
                                             app_data_time)
           VALUES (p_academic_year_id,
                   p_term_id,
                   p_class_id,
                   p_class_group_id,
                   p_subject_id,
                   p_student_roll,
                   w_subject_total_mark,
                   w_total_subject_op_mark,
                   w_grade_name,
                   w_result_gpa,
                   p_app_user_id,
                   current_timestamp);
   END IF;

   o_gpa := w_result_gpa;
   o_grate := w_grade_name;
   o_status := 'S';
   o_errm := '';
EXCEPTION
   WHEN OTHERS
   THEN
      o_errm := SQLERRM;
      o_status := 'E';
END;
$$;


