                 AND r.term_id = p_term_id);

      DELETE FROM
         edu_exam_single_mark s
            WHERE     s.academic_year = p_academic_year_id
                  AND s.class_id = p_class_id
                  AND s.term_id = p_term_id;
   END;


   o_status := 'S';
   o_errm := '';
EXCEPTION
   WHEN OTHERS
   THEN
      o_errm := SQLERRM;
      o_status := 'E';
END;
$$;


