CREATE FUNCTION public.fn_storing_dtails_exam_marks(p_academic_year_id integer, p_term_id integer, p_class_id character, p_app_user_id character, OUT o_status character, OUT o_errm character) RETURNS record
    LANGUAGE plpgsql
    AS $$
DECLARE
   w_mark_details   RECORD;
BEGIN
   BEGIN
      INSERT INTO edu_storing_exam_marks_details (academic_year,
                                                  term_id,
                                                  class_id,
                                                  class_group_id,
                                                  exam_id,
                                                  exam_no,
                                                  subject_id,
                                                  student_roll,
                                                  total_exam_marks,
                                                  obtain_marks,
                                                  result_grade,
                                                  grade_point_average,
                                                  app_user_id,
                                                  app_data_time)
         SELECT p_academic_year_id,
                r.term_id,
                p_class_id,
                r.class_group_id,
                r.exam_id,
                r.exam_no,
                r.subject_id,
                r.student_roll,
                r.total_exam_marks,
                r.obtain_marks,
                r.result_grade,
                r.grade_point_average,
                p_app_user_id,
                current_timestamp
           FROM edu_exam_marks_details r
          WHERE     r.academic_year = p_academic_year_id
                AND r.class_id = p_class_id
                AND r.term_id = p_term_id;

      DELETE FROM
         edu_exam_marks_details d
            WHERE     d.academic_year = p_academic_year_id
                  AND d.class_id = p_class_id
                  AND d.term_id = p_term_id;
   END;

