ALTER FUNCTION public.fn_storing_dtails_exam_marks(p_academic_year_id integer, p_term_id integer, p_class_id character, p_app_user_id character, OUT o_status character, OUT o_errm character) OWNER TO jameaquasemia;

--
-- Name: fn_view_class_subject_mark(integer, integer, character, character, character); Type: FUNCTION; Schema: public; Owner: jameaquasemia
--

CREATE FUNCTION public.fn_view_class_subject_mark(p_academic_year_id integer, p_term_id integer, p_class_id character, p_class_group_id character, p_app_user_id character, OUT o_student_marks character, OUT o_status character, OUT o_errm character) RETURNS record
    LANGUAGE plpgsql
    AS $$
DECLARE
   w_student_marks   RECORD;
   w_all_subject     RECORD;
BEGIN
   --    TRUNCATE TABLE edu_subjectmarktemp;
   DELETE FROM edu_subjectmarktemp
         WHERE app_user_id = p_app_user_id;

   FOR w_all_subject IN (SELECT subject_id
                           FROM edu_subject_list
                          WHERE class_id = p_class_id)
   LOOP
      INSERT INTO edu_subjectmarktemp (student_roll,
                                       academic_year,
                                       class_id,
                                       subject_id,
                                       total_marks,
                                       total_obtain_marks,
                                       result_gpa,
                                       grade_name,
                                       app_user_id,
                                       app_data_time)
         WITH
            exams
            AS
               (SELECT *
                 FROM edu_exam_single_mark
                WHERE     academic_year = p_academic_year_id
                      AND class_id = p_class_id
                      AND term_id = p_term_id
                      AND subject_id = w_all_subject.subject_id),
            student_marks
            AS
               (  SELECT student_roll,
                         sum (total_exam_marks) AS total_marks,
                         sum (obtain_marks) AS total_obtain_marks
                    FROM exams
                GROUP BY student_roll)
         SELECT DISTINCT
                (e.student_roll),
                e.academic_year,
                e.class_id,
                e.subject_id,
                m.total_marks,
                m.total_obtain_marks,
                (SELECT result_gpa
                 FROM fn_get_result_gpa (m.total_obtain_marks, m.total_marks))
                   result_gpa,
                (SELECT grade_name
                 FROM fn_get_result_gpa (m.total_obtain_marks, m.total_marks))
                   grade_name,
                p_app_user_id,
                current_timestamp
           FROM student_marks m
                LEFT JOIN exams e ON e.student_roll = m.student_roll;
   END LOOP;
EXCEPTION
   WHEN OTHERS
   THEN
      o_errm := SQLERRM;
      o_status := 'E';
END;
$$;


